ca&rsquo;s College (VIC)<br />Prison Fellowship of Australia (VIC)</div></div>', 'No'),
(76, 96, '<h1>Testimonials </h1>Hello George, I am posting you the evaluation forms from your session on 4 May. As you will see everyone loved it and you were the star of the training program! I am even inspired to bring the Nov training forward a week so you can still be the last session in the program&hellip;Thank you for your excellent session and for sharing your personal experiences. It was greatly appreciated by all of us. Regards Mary<br />Mary Davidson - Principal Training Officer <br />Youth Justice Training Unit. Department of Communities<br /><br />George was informative, approachable, friendly and confident in his knowledge. He presented the topic in an interesting way and allowed enough flexibility for our staff members to ask questions when needed.<br />Shaan Ross &ndash; Dpt of Corrective Services (Southern)<br /><br />Hi George&hellip; I am glad for you that you are moving to QLD but say it is going to be our loss. Thanks for everything you have done for us, the staff at Greensborough still talk about you and the presentation you gave and have without exception said that they have never had drugs explained so well and understandable&hellip;<br />Nancie Marchbank &ndash; Senior Corrections Officer<br />Greensborough Community Correctional Services <br /><br />Hey George, &hellip;I would like to push for the working with drug and alcohol related clients level 2 to be held in Cairns. I fully support the process of treatment that is taught in the session and believe this would be extremely beneficial to all employees working with clients here... Once again, thank you.<br />Bobby - Youth Worker - Cairns Youth Justice<br /><br />Written References available from (Queensland):<br />Gold Coast Drug Council<br />Gold Coast Mental Health and Drug &amp; Alcohol Service<br />Queensland Health &ndash; Dual Diagnosis Clinician<br />Transformation Ministries (AOD Rehab)<br />Fairhaven Detox &ndash; Salvation Army<br />St Monica&rsquo;s College (VIC)<br />Prison Fellowship of Australia (VIC)', 'No'),
