(83, 107, '<a href=\"http://www.bubblecmslite.com\">Bubble CMS Lite</a>  was designed to fulfill the need of a simple to use content management system that could handle multiple websites in multiple languages. There are multiple modules available for Bubble CMS Lite and we can also customize it to your needs, Creative Web Logic.Net has <a href=\"/Web-Design-Development/\">extensive web design knowledge</a>  in many areas expertise from games to email marketing.&nbsp; &nbsp; <br />', 'No'),
(118, 181, '<p>Periscope <a target=\"_blank\" href=\"http://www.periscopeconsulting.com.au\">risk management software</a>  helps Australian Business manage their internal and external obligations. The company provides a unique and comprehsive software solution designed to give this data meaning,to make the information useful through administration, reporting and collaboration.</p>  <p style=\"text-align: justify\">Their risk software solution is very powerful and flexible, it is also a leading edge management tool that provides enterprise wide solutions for Risk, Quality, Compliance, Documentation, Environmental, OHS, Audits, and Training. Integrated and customisable workflow and risk management tools providing case management,&nbsp; controls, email/task escalation, and Reporting.&nbsp;&nbsp; <br /></p>      ', 'No'),
(84, 108, 'Australian Churches Directory', 'No'),
(85, 109, '<p>Welcome to the aa sign-up page send your request to <a href=\"mailto:aa@clarencevalleynsw.com\">aa@clarencevalleynsw.com</a> <br /></p>', 'No'),
(86, 110, 'Hello World !!\r\n\r\nWelcome to Online Website Development Business. We offer custom dynamic design and development systems that are garenteed to provide all the features necessary to fulfill anyones online needs.<br /><br /> We can design and develop in most magor programming languages whether it open source PHP / MySQL or Microsoft\'s Visual Studio C# and ASP.Net.<br /><br /> With over 30 years in the business their isn\'t much that we couldn\'t achieve if we put our minds to it. We also have experience in Linux server administration and offer hosting packages from $2 a month for a shared account to dedicated hardware solutions.<br /><br />\r\nOver the years we have designed many reusable coding products including a website builder / Content Management System also Shopping Cart, Affiliate Marketing and SMS / Email Partner systems. All our systems conform to SEO / SEM knowledge bases and because its custom software it gives that extra advantage.<br /><br />\r\n We are based in Sydney Australia and can be reached in business hours through the phone of the various other communication systems.\r\n<br /><br />\r\nAll projects go through a rigorous planning and development processes, with  systems analysis, specifications, design brief and templating.<br /><br />', 'No'),
(87, 111, 'send a request to <a href=\"mailto:aa@clarencevalleynsw.com\">aa@clarencevalleynsw.com</a> <br />', 'No'),
