(89, 116, '<p>Thank You For Registering, use the Login link above and put your email and password in and then you will be in the members area. Follow the link to your user details and modify your directory description box and your sub website will be created, for example jims-mowing.yambansw.net. If you already have a website you can enter your address and it will show up on your sub-domain, all we ask is that you please link back to us. That way we all win!<br>&nbsp;</p>', 'No'),
(92, 129, 'Welcome to the Website Development Business Site.<br /><br>\r\nWe have been designing web pages now for over 30 years in Sydney Australia.<br>\r\nYears of experience gives us the advantage when building anew or customizing the old. We are experienced in SEO / SEM and cater for them in all our creations. We have a number of dynamic projects that get reused and applied to the specifications needed.<br><br>\r\nWe can provide hosting to give your website a home. We have a number of options including CPanel and a website builder software. Just pick your template and add your  content through our BubbleCMS Website Building Software.<br><br>\r\nWe are proficient in most open source programming languages such as PHP / MySQL / HTML / CSS and also Microsoft Visual Studio including ASP.Net | C#. <br><br>\r\nFor our servers we use Linux primarily and have a number of servers that we manage our site network with. We also have experience with Microsoft Server Software.<br><br>\r\nFor online business we have experience in Multi Level Marketing, Email solutions, Casino Games and Affiliate / Merchant Incentive Programs. We have had years of experience in the travel industry or even dating sites.<br><br>\r\nAlso going with your online presence we have developed many automated payment gateway solutions.\r\n', 'No'),
