(102, 145, '<p class=\"MainText\">Periscope Consulting ENTERPRISE <a href=\"http://www.periscopeconsulting.com.au/\" target=\"_blank\">Risk Management Software</a> and Compliance Management.</p><p><span class=\"MainText\"><br />Business compliance requires shared responsibilities and security profiles when looking at corporate infrastructure. Periscope consulting providesfully Integrated Software Solutions for integrated compliance management. Configuring systems for Risk, Quality, OH&amp;S, Environment and Documents is what periscope does best. Periscope delivers comprehensive software that enables your valuable data and information,<br />to facilitate greater integration between your systems and processes.<br /><br />*Generate simple to comprehensive dynamic reports through crystal reports<br />*Automatically schedule emails, events and task with email alerts.<br />*Configureable, screens, workflows &amp; emails for all your compliance obligations<br />*Observe Audits, Corrective Actions, Business Contracts, link objects, or such activities as workflow, emails, etc</span><br /><br /></p>', 'No'),
