(223, 324, 'potential in search engine marketing, we can optimize your site so search engines like google, yahoo, msn can interpret your details in the best light possible. We can launch a campain on your behalf, utilizing the latest technologies to bring you the best results. Learn More...\r\n\r\nHosting\r\nWe can host your website, we offer php/cgi/mysql/video streaming server\r\n\r\nSilver Hosting	Gold Hosting\r\nAUD $16.50 Month\r\n1000MB Webspace\r\n1 MySQL Database\r\n100GB Transfer	AUD $33 Month\r\n3000MB Webspace\r\n10 MySQL Database\r\n300GB Transfer\r\nVideo Streaming Server\r\n\r\nAdditional transfer costs AUD $11 per 100GB\r\nEmail Marketing\r\n Whether you are a small or large business you have customers. Our site SMSMailPro enables you to store that important customer data and use it to your full advantage. Filter by standard or custom fields when sending your latest communication. Queue up messages for later dates or put your contacts into an autoresponder so they receive a constant stream of messages from the time they sign up or are entered into the system. Easily intergrate our software into your website with a minimum of fuss. Manage your online presense from one place with web based email built in so you can check your mailbox and then convert a new lead into a contact with a single click. SMS Messages Coming Soon!!!\r\n\r\nAffiliate Marketing\r\nTo help promote the businesses we design for we created Partners Pro. Partners Pro is a new, state of the art Affiliate & Merchant site designed to bring together online marketers and online merchants for a mutually rewarding experience. A Partners Pro Affiliate can select from a range of merchant offerings to market on various commission rates, these types can be pay per click, pay per lead or pay per sale. For the merchant one of the best ways to drive traffic and customers to your web site is setting up your own Pay-for-Performance rewards program (popularly known as the affiliate program). Now, with Partners Pro, you can have your own Pay-for-Performance rewards program up and running in no time and all the work is done for you!\r\n\r\nDomain Name Registration\r\n Professional, Discount Registration. Every web site needs a domain name so go to IWebBiz Domains and register your businesses home address! We can register Australian .com.au domains as well and much cheaper than most.\r\n\r\nPicking your domain name is very important, especially for search engine rankings. For example the website http://www.goldcoastsafetycertificates.com/ ranks great for the search term \" Gold Coast Safety Certificates\", number 1 in google actually. It is true that many domain names are already taken but many locally termed domain names aren\'t. For example if you were a plumber based in Benowa/Gold Coast/Queensland/Australia you could easily get the domain name www.benowaplumbing.com. This is very important because people often put the locality of there search into the text they search for.', 'No'),
(3153, 379, '<div style=\"width:100%;Height:500px\">\r\n<img src=\"https://static-assets.site/admin/images/hosting-server-tech-icons.jpg\" align=\"left\" style=\"padding:20px\">\r\nWelcome to iCreative Web Logic Network CPanel hosting website.<br>\r\n\r\n<br>\r\ncPanel is the ultimate solution for those tired of managing their website and hosting account through confusing interfaces and complicated commands. Boasting a user-friendly interface, cPanel puts users in control with its intuitive design, allowing them to easily manage their website, email, and hosting settings.<br>\r\n<br>\r\nBut the benefits don\'t stop there. cPanel also includes advanced features and powerful tools that provide unprecedented control over website and hosting accounts. From robust security features to easy-to-use backup and restore options, cPanel has everything needed to keep websites running smoothly.<br>\r\n<br>\r\nMoreover, cPanel seamlessly integrates with popular apps and services, allowing for easy expansion of website functionality and growth of online presence. With a team of experts available 24/7, users can be assured that their website is in good hands.<br>\r\n<br>\r\nMillions of users worldwide rely on cPanel as their go-to web hosting control panel for good reason. cPanel offers a comprehensive set of features and tools, including file, email, website, and domain management, collaboration tools, and security features, making website and hosting account management easy and efficient.<br>\r\n</div>', 'No'),
