(3145, 371, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n          <!--DWLayoutTable-->\r\n          <tr>\r\n            <td valign=\"top\" bgcolor=\"#FFFFFF\" class=\"content\"><p align=\"left\" class=\"style2\"><span class=\"style4\">What Is The Peak Oil Crisis And How Its Helped By  TOHO 9000</span><br>\r\n              <img src=\"Pics/dotted_Line.gif\" width=\"725\" height=\"1\" align=\"top\"></p>\r\n              <p><img src=\"Pics/300px-Hubbert_peak_oil_plot.svg.png\" alt=\"Peak Oil Toho 9000\" width=\"300\" height=\"200\" align=\"right\"></p>\r\n              <p>As first expressed in Hubbert peak theory, <strong>peak oil</strong> is the point or timeframe at which the maximum global petroleum production rate is reached. After this timeframe, the rate of  production will by definition enter terminal decline. According to the Hubbert model, production will follow a roughly symmetrical bell-shaped curve.</p>\r\n              <p>Some observers such as Kenneth S. Deffeyes, Matthew Simmons, and <a href=\"http://en.wikipedia.org/wiki/James_Howard_Kunstler\" title=\"James Howard Kunstler\">Ja</a>mes Howard Kunstler believe that because of the high dependence of most modern industrial transport, agricultural and industrial  systems on inexpensive oil, the post-peak production decline and  possible resulting severe price increases will have negative implications for the global economy.  Predictions as to what exactly these negative effects will be vary  greatly. More optimistic outlooks, delaying the peak of production to  the 2020s or 2030s and assuming major investments in alternatives occur  before the crisis, show the price at first escalate and then retreat as  other types of fuel sources are used as transport fuels and fuel  substitution in general occurs. More dire predictions which operate on  the thesis that the peak will occur shortly or has already occurred  predict a global depression and even the collapse of industrial global  civilization as the various feedback mechanisms of the global market  cause a disastrous chain reaction. The shortfall will cause demand destruction which may be mitigated with planned conservation measures and using alternatives.</p>\r\n            <h3>Peak oil productionâ€”has it happened already?</h3>\r\n            <dl>\r\n              <dd>Â </dd>\r\n              <table border=\"0\" cellspacing=\"5\" cellpadding=\"5\">\r\n                <tr>\r\n                  <td width=\"71%\"><p>As of July of 2007, analysts still disagree on whether peak production capacity has been reached.</p>\r\n                    <p>The July 2007 IEA Medium-Term Oil Market Report projects non-OPEC  liquids supply (to include biofuels) to reach 51.0 mb/d in 2008,  appearing to recede thereafter as the slate of verifiable investment  projects diminishes.</p>\r\n                    <table align=\"center\">\r\n                      <tbody>\r\n                        <tr>\r\n                          <td valign=\"top\" width=\"20\">â€œ</td>\r\n                          <td valign=\"top\">The concept of peak oil  production and its timing are emotive subjects which raise intense  debate. Much rests on the definition of which segment of global oil  production is deemed to be at or approaching peak. Certainly our  forecast suggests that the non-OPEC, conventional crude component of  global production appears, for now, to have reached an effective  plateau, rather than a peak.</td>\r\n                          <td valign=\"bottom\" width=\"20\">â€</td>\r\n                        </tr>\r\n                      </tbody>\r\n                    </table>\r\n                    <p>The report points to only a small amount of supply growth from OPEC producers, with 70% of the increase coming from Saudi Arabia, the UAE and Angola as security and investment issues continue in Iraq, Nigeria and Venezuela.<a href=\"http://en.wikipedia.org/wiki/Peak_oil#_note-IEAMediumTermMarketReport200707\" title=\"\"></a></p>\r\n                    <p>Analysts from Wood Mackenzie contend that maximum production of oil will not occur before 2014. Kate  Dourian, Platts\' Middle East editor, has a different opinion. \"Some  sources say half the world\'s oil has already been produced, whereas  Saudi Aramco is saying there is still another trillion barrels out  there.\" She is also quick to point out that politics has entered the  equation. \"Some countries are becoming off limits. Major oil companies  operating in Venezuela find themselves in a difficult position because  of the resource nationalism that\'s spreading. These countries are now  reluctant to share their reserves\"</p></td>\r\n                  <td width=\"29%\"><dl>\r\n                    <dt>Â </dt>\r\n                  </dl>\r\n                    <div>\r\n                      <div><a href=\"http://en.wikipedia.org/wiki/Image:Crude_NGPL_IEAtotal_1960-2004.png\" title=\"World Crude Oil Production 1960-2004. Sources: DOE/EIA, IEA\"><img alt=\"World Crude Oil Production 1960-2004. Sources: DOE/EIA, IEA\" longdesc=\"/wiki/Image:Crude_NGPL_IEAtotal_1960-2004.png\" src=\"http://upload.wikimedia.org/wikipedia/en/thumb/7/71/Crude_NGPL_IEAtotal_1960-2004.png/180px-Crude_NGPL_IEAtotal_1960-2004.png\" height=\"120\" width=\"180\"></a>\r\n                          <div>\r\n                            <div><a href=\"http://en.wikipedia.org/wiki/Image:Crude_NGPL_IEAtotal_1960-2004.png\" title=\"Enlarge\"><img src=\"http://en.wikipedia.org/skins-1.5/common/images/magnify-clip.png\" alt=\"\" height=\"11\" width=\"15\"></a></div>\r\n                            World Crude Oil Production 1960-2004. Sources: DOE/EIA, IEA</div>\r\n                      </div>\r\n                    </div>\r\n                    <div>\r\n                      <div><a href=\"http://en.wikipedia.org/wiki/Image:GlobalCrudeOilProduction2001-mid2007.png\" title=\"World Crude Oil Production 2001-2007. Source: U.S. Energy Information Agency\"><img alt=\"World Crude Oil Production 2001-2007. Source: U.S. Energy Information Agency\" longdesc=\"/wiki/Image:GlobalCrudeOilProduction2001-mid2007.png\" src=\"http://upload.wikimedia.org/wikipedia/en/thumb/5/5e/GlobalCrudeOilProduction2001-mid2007.png/180px-GlobalCrudeOilProduction2001-mid2007.png\" height=\"135\" width=\"180\"></a>\r\n                          <div>\r\n                            <div><a href=\"http://en.wikipedia.org/wiki/Image:GlobalCrudeOilProduction2001-mid2007.png\" title=\"Enlarge\"><img src=\"http://en.wikipedia.org/skins-1.5/common/images/magnify-clip.png\" alt=\"\" height=\"11\" width=\"15\"></a></div>\r\n                            World Crude Oil Production 2001-2007.<a href=\"http://en.wikipedia.org/wiki/Peak_oil#_note-32\" title=\"\"></a> Source: U.S. Energy Information Agency</div>\r\n                      </div>\r\n                    </div></td>\r\n                </tr>\r\n              </table>\r\n              </dl>\r\n            <p class=\"style2\">How TOHO9000 Can Help In The Peak Oil Crisis</p>\r\n            <p>If TOHO 9000 is added to regular engine oil, a car can travel 100,000KM without changing its oil. Normally oil should be changed every 5,000 KM and if on average 4 litres of oil is used that means about 100 litres is used for normal oil compared to Toho 9000\'s 4 litres. Thats 2500% more efficient. This is defininatly an environmentally friendly way to combat this peak oil crisis. We may not be able to solve the peak oil crisis, maybe extend the amount of time we have but think what will happen to the price of oil when demand exceeds supply. Logically it will go up and TOHO 9000 will be available to save you money.</p>\r\n            <p>TOHO 9000 is not a regular engine oil treatment. One regular engine oil  treat usually only for one kind, but TOHO 9000 oil works on any  vehicles or machines. TOHO 9000 is invested for increased high  performance. More engine protection and less fuel consumption. You save  oil and labour costs for heavy and light machinery, plant operation,  construction plant, agricultural machinery and motor vehicles such as  buses, taxi and ships. TOHO 9000 assured you of high performance at all  season. It is a genuine, superb engine oil additive, It acts as  anti-wear agent, viscosity improver, corrosion inhibitor and  ester-diester engine lubricant TOHO WOO contains ester-diester  synthetic base oil and retains viscosity at extremely high temperature  for extra protection in hot summers, yet pour freely at subzero  temperatures for easy starting in cold winters. TOHO 9000 resists  oxidation much better than petroleum based oil and have a powerful  cleaning action that dissolves and suspends sludge, varnish and carbon  deposits. All these unique characteristics are not present in normal  petroleum based oil.</p>\r\n            <p align=\"center\" class=\"style2\">For more information about how TOHO9000 can help in this time of crisis and where you can help by buying online visit our main site at <a href=\"http://www.toho9000.com\">http://www.toho9000.com</a>.</p>\r\n            <p>Videos - Click On The Thumbnails Below The Main Viewer To Load..</p>\r\n            <p align=\"center\">\r\n              <?=$yt->EmbedVideo($Vid.\'&mode=user&search=\');?>\r\n            </p>\r\n            <table width=\"53%\" border=\"0\" align=\"center\" cellpadding=\"5\" cellspacing=\"5\">\r\n              <tr>\r\n                <td align=\"center\"><a href=\"index.php?Vid=<?=urlencode(\"http://www.youtube.com/watch?v=c-h5D0anrfU\");?>\"><?=$yt->ShowImg(\'http://www.youtube.com/watch?v=c-h5D0anrfU\',2);?></a></td>\r\n                <td align=\"center\"><a href=\"index.php?Vid=<?=urlencode(\"http://www.youtube.com/watch?v=QovBLFZhQME\");?>\"><?=$yt->ShowImg(\'http://www.youtube.com/watch?v=QovBLFZhQME\',2);?></a></td>\r\n                <td align=\"center\"><a href=\"index.php?Vid=<?=urlencode(\"http://www.youtube.com/watch?v=XNjZnRA2m68\");?>\"><?=$yt->ShowImg(\'http://www.youtube.com/watch?v=XNjZnRA2