(3132, 358, '<p align=\"left\" class=\"style5\">Test Results<br>\r\n                <img src=\"Pics/dotted_Line.gif\" width=\"725\" height=\"1\"></p>\r\n              <table width=\"90%\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n                <tr>\r\n                  <td width=\"50%\" valign=\"top\">\r\n                    <div align=\"left\">Wear & tear test has been successfully carried out in Fukuoka Institute of Technology, together with many vigorous road tests on taxis, heavy vehicles and other vehicles from major transport companies. Japan Airlines have also conducted durability tests on TOHO, which is now used in all JAL Ground vehicles (<a href=\"/research/\">Research</a>). </div></td>\r\n                  <td width=\"50%\">\r\n                    <div align=\"center\"><img src=\"https://static-assets.site/bcms/templates/toho9000/Pics/test1.jpg\" width=\"250\" height=\"172\"></div></td>\r\n                </tr>\r\n                <tr>\r\n                  <td width=\"50%\">\r\n                    <div align=\"center\"><img src=\"https://static-assets.site/bcms/templates/toho9000/Pics/test2.jpg\" width=\"250\" height=\"160\"></div></td>\r\n                  <td width=\"50%\"><div align=\"left\"><br>\r\n        We also engaged an internationally reputed engine designer cum manufacturer, A VL GmbH to perform endurance test work on TOHO. Test procedures include durability test program of 1,250 engine operation hours, perform with a heavy duty diesel engine continuously running at 20-22 hours daily (Traveling mileage equivalent to 100,000 kin). Oil samples were taken for analysis at every 50 hours engine running time. Final test result shows engine performance is satisfactory and oil quality is in perfectly good condition. There is no sign of deterioration and oxidization (<a href=\"/Research/\">Research</a>).</div></td>\r\n                </tr>\r\n                <tr>\r\n                  <td colspan=\"2\">\r\n                    <div align=\"left\"><br>\r\n          AVL GmbH is an Austria Company established since 1948, they enjoy worldwide reputation among Automobile manufacturers.</div></td>\r\n                </tr>\r\n              </table>\r\n              <p>Â </p>\r\n              <table width=\"90%\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n                <tr>\r\n                  <td height=\"19\" colspan=\"4\"><div align=\"center\">\r\n                      <h2>OIL CHECK Australian Testing</h2>\r\n                  </div></td>\r\n                </tr>\r\n                <tr>\r\n                  <td width=\"25%\"><div align=\"center\"><a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/InpecPage1.jpg\" target=\"_blank\">INSPEC Test Page 1</a></div></td>\r\n                  <td width=\"25%\"><div align=\"center\"><a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/InpecPage2.jpg\" target=\"_blank\">INSPEC Test Page 2</a></div></td>\r\n                  <td width=\"25%\"><div align=\"center\"><a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/InpecPage3.jpg\" target=\"_blank\">INSPEC Test Page 3</a></div></td>\r\n                  <td width=\"25%\"><div align=\"center\"><a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/InpecPage4.jpg\" target=\"_blank\">INSPEC Test Page 4</a></div></td>\r\n                </tr>\r\n                <tr>\r\n                  <td><div align=\"center\"><a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/InpecPage5.jpg\" target=\"_blank\">INSPEC Test Page 5</a></div></td>\r\n                  <td><div align=\"center\"><a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/InpecPage6.jpg\" target=\"_blank\">INSPEC Test Page 6</a></div></td>\r\n                  <td><div align=\"center\"><a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/InpecPage7.jpg\" target=\"_blank\">INSPEC Test Page 7</a></div></td>\r\n                  <td><div align=\"center\"><a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/InpecPage8.jpg\" target=\"_blank\">INSPEC Test Page 8</a></div></td>\r\n                </tr>\r\n              </table>', 'No'),
(3133, 359, '<p align=\"left\" class=\"style5\">Research<br>\r\n                  <img src=\"https://static-assets.site/bcms/templates/toho9000/Pics/dotted_Line.gif\" width=\"725\" height=\"1\"></p>\r\n                <p align=\"left\">Since the establishment of our company, we have been engaged in both research into engine oil and the conception of environmental protection. The problem caused by major transportation vehicles, heavy and light machinery and industry have been addressed in our research; since excess emission of waste gases from these sources has resulted in the greenhouse effectâ€™, which will influence the survival of mankind.</p>\r\n                <p align=\"left\">Ten years ago, most countries were not clearly aware of the greenhouse effectâ€™ and has no idea of its harmfulness or severity. But now everyone recognizes how serious and imminent this problem is.</p>\r\n                <p align=\"left\">According to information collected by the Earth Committee of the World, developed countries had discharged more than 16 billion tons of carbon monoxide by 1972. However, the amount had increased to 23 billion tons by 1994. If the situation continues to develop at the same rate, then 46 billion tons of carbon monoxide will have been produced by those developed countries by 2070.</p>\r\n                <p align=\"left\">At present, the 23 billion ton of carbon monoxide that have been emitted by the developed countries have formed â€˜greenhouse gasesâ€™ in the atmosphere, resulting in a temperature rise of one degree. The ice mountains in the South Pole have started to melt at an alarming rate. It is difficult to imagine the harm being caused by the rise of the sea level.</p>\r\n                <p align=\"left\">What adverse effects are caused when we add engine oil into engines and machines? We recognize that a lot of different engine oils on the market do not meet the needs of the consumers; even though many types of engine oils and additives have been invented to prolong engine life, reduce harmful emissions and retain quality, the benefits obtained have been very limited. Generally speaking, prolonging the life of engine oil does not make a very beneficial contribution to the reduction of pollution. In conclusion, we are still far from a satisfactory solution.</p>\r\n                <p align=\"left\">Today we have reached a turning point in promoting highly sophisticated products and developing modem technology thus obeying the slogan â€œreduce side effects, prolong the life of the engine oil and protect the environmentâ€. In the meantime, we will continue our best efforts to invent a new series of products to replace traditional oils. With a concerted research effort, the end result will be overall high quality, evident reduction of emissions, prolonged engine life, and improved productivity, with benefits for the consumers and the environment.</p>\r\n                <p align=\"left\">For the past ten years, our expert research engineers have been concentrating on a project to create a brand new kind of oil additive. After many setbacks and a great deal of hard work, we achieved a breakthrough. A first-rate oil additive has been developed and produced successfully.</p>\r\n                <p align=\"left\">This product, which has created plenty of excitement in Japanese industry, not only stands out in the market, but also brings many benefits to consumers and the environment.</p>\r\n                <p align=\"left\">Furthermore, even though the market is depressed, our new product is still in short supply and demand is high. In the meantime, we have entered and occupied international markets successfully.</p>\r\n                <p align=\"left\">All these prove that our product possesses high quality and properties which are approved by the biggest Japanese marine insurance company.</p>\r\n                <p align=\"left\">Our Team will continue to work hard with vigorous energy and with our original intention to develop new high quality product. Sharing our success with our consumers is our main objective into the future.</p>\r\n                <p align=\"left\">Finally, we want to express our extreme gratitude on behalf of our company. Thank you for your generous support.</p>\r\n                <img src=\"https://static-assets.site/bcms/templates/toho9000/Pics/dotted_Line.gif\" width=\"725\" height=\"1\">                \r\n                <p align=\"left\">A car runs on the energy produced when fuel is combusted in cylinders. However, not all this energy can be derived through the crankshaft. In fact, a mere 30% of the total energy is all that can be extracted. The main role of engine oil is to reduce friction, and thus reduce engine wear and tear of every part of the engine.</p>\r\n                <p align=\"left\">The oil circulation inside the engine is similar to the blood flow in the human body. Once the oil has deteriorated or oxidized, serious problems of engine productivity will develop.</p>\r\n                <p align=\"left\">Through proven experiments, normal engine oil will start to deteriorate and oxidize when the vehicle travels in excess of 1000 km. This may lead to friction damage, loss in viscosity, excess emission, reduction in the life span of the engine, and an increase in the consumption of fuel and engine oil.</p>\r\n                <p align=\"left\">After extensive research and experiment, our scientists have successfully invented a new kind of genuine, superb engine oil additive from over 90 different substances. It is able to eliminate the harmful effects to the internal parts of the engine, and reduce fuel and oil consumption drastically.</p>\r\n                <p align=\"left\">Our product is guaranteed for 120,000 km to 200,000 km when the engine is in good condition. The scale of which depends on the quality of normal engine oil used. When the engine is running, its unique characteristics of high viscosity and consists of micro-particles can penetrate deep into all parts of the engine and extremely small pores of the metal surface. The force can be applied in line with the piston movement accordingly. Strong oil film also enhances the dampen effect and thus reduce the engine noise.</p>\r\n                <p align=\"left\">It reduces the frictional resistance of the moving parts and thus reduces the wear and tear of engine. This in turn increases the internal combustion of engine (Increase in horsepower). Easy ignition of engine even at sub-zero temperature (~21oC to -45â€C) in cold winter because of its superb adhesive characteristics. Moreover, it has the properties of high level of heat resistance, acid-proof, water separation, sealing effect, anti-rust protection, cleaning effect, viscosity index (236-248), long-lasting neutralizing effect, anti-emulsifying, resulting in the reduction of the exhaust emission. Hence, the quality of the oil will not degrade over long period of time.</p>\r\n                <p align=\"left\">With all the above benefits and characteristics, TOHO 9000 should be the only genuine, superb engine oil additive of the 21st century that will save consumers time and effort in changing their engine oil.</p>\r\n                <p align=\"left\">Furthermore, our product has not only major benefits in reducing labor and material costs for heavy and light machinery, plant operation, construction plant, agricultural machinery and motor vehicles such as buses, taxis and ships; but also plays a major role in conserving natural resources, which is essential for the survival of mankind.</p>\r\n                <table width=\"90%\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n                  <tr>\r\n                    <td>\r\n                      <p>Japan Airlines</p>\r\n                      <ul>\r\n                        <li><a href=\"/jal-page1/\">Correspondence Page 1</a></li>\r\n                        <li><a href=\"/jal-page2/\">Correspondence Page 2</a></li>\r\n                    </ul></td>\r\n                    <td>\r\n                      <div align=\"center\"><img src=\"https://static-assets.site/bcms/templates/toho9000/Pics/jal1.jpg\" width=\"250\" height=\"90\"></div></td>\r\n                  </tr>\r\n                </table>\r\n                <p>AVL </p>\r\n                <ul>\r\n                  <li>\r\n                    <div align=\"left\"><a href=\"/avl-page-1/\">Correspondence between AVL and TOHO dated 7 November :1996</a></div>\r\n                  </li>\r\n                  <li>\r\n                    <div align=\"left\"><a href=\"/avl-page-2/\">AVL Report No: BV 0642 dated December 1996 - Endurance Test with TOHO 9000 Oil Additive on the Liebherr D926 TI-E Engine</a></div>\r\n                  </li>\r\n                  <li>\r\n                    <div align=\"left\"><a href=\"/avl-page-3/\">Correspondence between Liebherr and AVL dated 16 June 1997</a></div>\r\n                  </li>\r\n                  <li>\r\n                    <div align=\"left\"><a href=\"/avl-page-4/\">Statement by Institut fur Mineralprodukte und Umweltanalytik (no. 1772/97) dated 24 June 1997 on the oil assitive TOHO 9000 based upon the AVL repot BV 0642 of December 1996</a></div>\r\n                  </li>\r\n                </ul>', 'No'),
(3134, 360, '<h2>AIRPORT REPORT ENGINEERING &amp; SERVICE Co., LTD.<br>\r\n              <br>\r\n                <img src=\"https://static-assets.site/bcms/templates/toho9000/Pics/dotted_Line.gif\" width=\"725\" height=\"1\"></h2>\r\n              <div align=\"center\">\r\n                <p align=\"left\">Telefax</p>\r\n                <p><img src=\"https://static-assets.site/bcms/templates/toho9000/Pics/dotted_Line.gif\" width=\"725\" height=\"1\"></p>\r\n                <p align=\"left\">To Company Japan Airlines Company LTD<br>\r\n    Telefax&#151;No. 61-2-9283-2721<br>\r\n    Date :18 May 1998<br>\r\n    Name: Michelle Berryman<br>\r\n    Dept: Public Relations Officer<br>\r\n                </p>\r\n                <img src=\"https://static-assets.site/bcms/templates/toho9000/Pics/dotted_Line.gif\" width=\"725\" height=\"1\">                <p align=\"left\">From Name Makoto Endoh<br>\r\n    Telefax&#151;No. 724-55-3470 <br>\r\n    Direct phone :724-55-3467<br>\r\n                </p>\r\n                <img src=\"https://static-assets.site/bcms/templates/toho9000/Pics/dotted_Line.gif\" width=\"725\" height=\"1\">                <p align=\"left\">Subject : TOHO Extra Long Life Motor Oil Dear Berrvman San</p>\r\n              </div>\r\n              <p align=\"left\">Thank you for your Telefax on 13 May 1998.<br>\r\n  We at Airport Engineering &amp; Service is a member of the JAL group.<br>\r\n  Kansai plant performs maintenance of Ground Support Equipment(G S E) for Aircraft.</p>\r\n              <p align=\"left\">( Please refer Profile 1 &amp; 2)</p>\r\n              <p align=\"left\">Secondly, We use TOHO 9000 oil in the Aircraft Tow Tractors, Cargo Loaders and Cargo tugs etc.<br>\r\n  TOHO oil is very good performance. For example, Case of Aircraft Tow Tractor&#146;s engine oil,<br>\r\n  Usually. Engine oil should be replaces every 250 hr of operating hour, But replacement interval<br>\r\n  of TOHO became every 2,500hr of operating hour. Also over haul Interval extended 125% more.<br>\r\n  If you have any questions, please contact me</p>\r\n              <p align=\"left\">Best regards<br>\r\n  ---------------------<br>\r\n  Makoto Endoh</p> ', 'No');
INSERT INTO `mod_text` (`id`, `content_pagesID`, `content_text`, `sidebar_content`) VALUES
(3135, 361, '<h2 align=\"left\" class=\"style2 style6\">Endurance Test with TOHO 9000 Oil Additive on the Liebherr D926 TI-E Engine <br>\r\n              <img src=\"../Pics/dotted_Line.gif\" width=\"725\" height=\"1\"></h2>\r\n              <p align=\"center\"><b>(Bore x Stroke: 122 x 142 mm) Final Report</b></p>\r\n              <p align=\"left\">Contents</p>\r\n              <p align=\"left\">1. <a href=\"#intro\" target=\"_self\">Introduction</a></p>\r\n              <p align=\"left\">2. <a href=\"#Summary\">Summary and Conclusions</a></p>\r\n              <div align=\"left\">\r\n                <blockquote>&nbsp;\r\n                </blockquote>\r\n              </div>              <blockquote><p align=\"left\">2.1. <a href=\"#Comparison\">Comparison of the Engine Performance and Emissions with- and without TOHO 9000</a><br>\r\n    2.2. <a href=\"#Lube\">Lube Oil Analysis Results</a><br>\r\n    2.3. <a href=\"#Visual\">Visual Inspection</a><br>\r\n    2.4. <a href=\"#Further\">Further Endurance Test Results</a><br>\r\n    2.5. <a href=\"#Conclusions\">Conclusions</a><br>\r\n                </p>\r\n              </blockquote>\r\n              <p align=\"left\">3. <a href=\"#Test\">Test Results</a></p>\r\n              <div align=\"left\">\r\n                <blockquote>&nbsp;\r\n                </blockquote>\r\n              </div>              <blockquote><p align=\"left\">3.1. <a href=\"#ComparisonTests\">Comparison Tests (Engine with and w/o TOHO)</a><br>\r\n    3.2. <a href=\"#Endurance\">Endurance Test Procedure</a><br>\r\n    3.3. <a href=\"#Chemical\">Chemical Lube Oil Analysis Results of the 1250 Hours Endurance Test with TOHO 9000</a><br>\r\n    3.3.1. <a href=\"#General\">General</a><br>\r\n    3.3.2. <a href=\"#Viscosity\">Viscosity, Insoluble\'s and Dispersant Efficiency</a><br>\r\n    3.3.3. <a href=\"#TBN\">TBN</a><br>\r\n    3.3.4. <a href=\"#Wear\">Wear Metals</a><br>\r\n    3.4. <a href=\"#VisualInspection\">Visual Inspection of the Main Engine Components after the 1250 Hours Test with TOHO 9000</a><br>\r\n    3.5. <a href=\"#FurtherEndurance\">Further Endurance Test Results</a></p>\r\n              </blockquote>\r\n              <p align=\"left\"><a name=\"Intro\"></a><b>1. Introduction</b></p>\r\n              <p align=\"left\"><br>\r\n  Based on the agreement between TOHO International Pty Ltd. and AVL dated 04-June-I 996, AVL was performing an engine durability program with the lube oil additive TOHO 9000 in order to demonstrate its long term effects on lube oil aging behavior (viscosity, TBN, insoluble\'s, wear metal content etc. indicative for oil change intervals) as well as on engine performance and emissions.</p>\r\n              <p align=\"left\">&nbsp;</p>\r\n              <div align=\"left\">\r\n                <table width=\"90%\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n                  <tr>\r\n                    <th colspan=\"2\">The engine used was the series production LIEBHERR D926 TI-E heavy-duty L-6 cylinder D.I. diesel engine:</th>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Bore x stroke: </td>\r\n                    <td>122 x 142 mm</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Swept volume:</td>\r\n                    <td>9.96 liter</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Water-cooled, turbo charged. Air/air inter cooled<br>\r\n        Power rating: </td>\r\n                    <td>230 kW at 2100 rpm</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Max. torque:</td>\r\n                    <td>1200-1235 Nm at 1400-1600 rpm</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Emission status: </td>\r\n                    <td>EURO 2</td>\r\n                  </tr>\r\n                </table>\r\n              </div>              <p align=\"left\">The test procedure was the MAN 500 hours test which includes constant load phases at rated power and peak torque and intermittent load phases (low idle to rated power).<br>\r\n  This test procedure was run two and a half times accumulating a total endurance test running time of 1250 hours which is equivalent to a vehicle running distance of approximately 100.000 km.</p>\r\n              <p align=\"left\"><br>\r\n  An identical engine was run at LMB (LiebhelT Machines Bulle) for 500 hours with standard lube oil without any additional additive and the results will be compared to those of AVL&#146;s test with<br>\r\n  TOHO 9000.</p>\r\n              <p align=\"left\">The 1250 hours test at AVL was performed without an oil change whilst the regular interval for changing the engine lube oil is 250 hours according to the engine manufacturer&#146;s standards. A mixture of 85% standard lube oil (Shell Rimula TX 10W30) and 15% TOHO 9000 was used (15% TOHO is more a blending component than an additive, however we name it &#147;additive&#148;). The oil consumed was regularly topped up with standard lube oil whilst the amount of oil taken out every 50 hours for the chemical analysis was replaced with the mixture.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Summary\"></a><b>2. Summary and Conclusions</b><br>\r\n  The results obtained during the subject test program are split up and summarized as follows:</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Comparison\"></a><b>2.1. Comparison of the Engine Performance and Emissions with- and without TOHO 9000</b></p>\r\n              <p align=\"left\">The comparison test was run at AVL before the endurance test program with the identical engine under exactly the same engine operating and similar ambient boundary conditions. Therefore, a conclusive judgment can be made:</p>\r\n              <p align=\"left\"> <b>Full load performance</b></p>\r\n              <p align=\"left\">The maximum power output, the fuel consumption and smoke emission is equivalent within the measurement accuracy.</p>\r\n              <p align=\"left\">The blow by of the engine dropped by approximately 5-8% under high speed/full load conditions, indicating some positive effect of TOHO 9000 with respect to the scaling capabilities of the piston-piston ring - cylinder liner area.</p>\r\n              <p align=\"left\"><b>ECE R49 emission test</b></p>\r\n              <p align=\"left\">Overall the same good level of engine-out emissions was observed for all measured emission components (NOx, HC, CO, particulates).</p>\r\n              <p align=\"left\"><a name=\"Lube\"></a><b>2.2. Lube Oil Analysis Results</b></p>\r\n              <p align=\"left\">The oil analysis (TBN, viscosity, insoluble\'s and wear metals) does not indicate any problems after 1250 hours running time.</p>\r\n              <p align=\"left\">TBN (ASTM-D-664 procedure) of the lube oil with 15% TOHO 9000 shows an unusually low degradation even after 1250 hours running time.</p>\r\n              <p align=\"left\">Adding TOHO 9000 to a SAE 10W30 lube oil results in a viscosity increase to a SAE 10W50 lube oil class and a drop with a short running time of 50 hours to a SAE 10W40 class oil. The viscosity was then stable within the SAE I 0W40 class up to 1250 hours running time.</p>\r\n              <p align=\"left\">The Dispersant activity of the lube oil containing TOHO 9000 is still excellent after 1250 hrs. engine running time.</p>\r\n              <p align=\"left\">Wear metals show a normal more or less linear increase in mg metal and this means TOHO 9000 does not influence engine wear.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Visual\"></a><b>2.3. Visual Inspection</b></p>\r\n              <p align=\"left\">From the visual inspection of the main engine components such as engine block, cylinder liner, pistons, piston rings, valves, manifolds etc. of the engine run for 1250 hours along the MAN endurance test cycle, it can be concluded that:</p>\r\n              <div align=\"left\">\r\n                <ul>\r\n                  <li> The visual condition of the engine with respect to visual engine wear and the buildup of deposits is equal or better compared to the engine run without an oil change for 500 hours using a similar standard oil without TOHO.</li>\r\n                    <li>A comparable engine run over 500 hours with the same oil and with the recommended oil change after 250 hours has been judged to be only marginally better.</li>\r\n                    <li>None of the engine components showed irregular or abnormal wear relative to the running time accumulated on the engine</li>\r\n                </ul>\r\n              </div>              <p align=\"left\">. </p>\r\n              <p align=\"left\">Taking into account that a standard lube oil - Shell Rimula TX 1 0W30 containing 15% of TOHO 9000 - had been used without an oil change and without changing the oil filter over 1250 hours along a quite severe test procedure, the visual condition of the engine was judged to be very good.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Further\"></a><b>2.4. Further Endurance Test Results</b></p>\r\n              <p align=\"left\">The engine full load performance and emissions as well as the lube oil consumption was recorded along the endurance test period in regular intervals of 250 hours.</p>\r\n              <p align=\"left\">A total amount of 63.5 liters lube oil (TX 1 0W30 w/o TOHO) had to be refilled over the running time of 1250 hours to compensate the natural lube oil consumption. This is approximately 3 times the oil filling volume of the subject engine.</p>\r\n              <p align=\"left\">None of the results indicated any abnormal engine behavior.</p>\r\n              <p align=\"left\">As no comparison data of engines of the same type run over the same running time and test cycle without TOHO are available (statistical scatter band), the obtained engine results cannot be correlated to the use of TOHO 9000 and figure as additional information only.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Conclusions\"></a><b>2.5. Conclusions</b><br>\r\n  Based on the lube oil analysis as well as on the visual inspection results of the engine main components, an extension of the running time to more than 1250 hours can be recommended.</p>\r\n              <p align=\"left\">No negative influence of the use of TOHO 9000 with respect to engine wear, power output or engine emissions arc indicated.</p>\r\n              <p align=\"left\"><a name=\"Test\"></a><b>3. Test Results</b></p>\r\n              <p align=\"left\"><a name=\"ComparisonTests\"></a><b>3.1. Comparison Tests (Engine with and w/o TOHO)</b></p>\r\n              <p align=\"left\">Before the start of the endurance test program, it was agreed to compare the engine full load and ECE R49 emission results of the Liebheii D926 TI-E engine using a standard lube oil first and then a mixture of 85% standard lube oil plus 15% TOHO 9000.</p>\r\n              <p align=\"left\">As standard oil Rimula TX 15W40 and 10W30 oils were used (see fig. <a href=\"../Pics/Figures/D3.jpg\" target=\"_blank\">D3</a>). Because the results just differ within the measurement accuracy, only the latter has been used for comparison. Subsequently, the oil was drained and replaced by a mixture of 85% Rimula TX 1 0W30 and 15% TOHO 9000. The engine was warmed up for approx. 15 minutes under idling conditions to assure a good mixing and after 6 hours running at various loads, the comparison full load test was performed.</p>\r\n              <p align=\"left\">As these tests have been carried out with the identical engine and the engine operating conditions (such as engine speed, boost pressure and temperature, fuel and oil temperature as well as coolant temperature etc.) were kept constant and also the ambient conditions (ambient temperature, barometric pressure) were similar, the obtained results allow conclusive judgments:<br>\r\n  As illustrated in fig. <a href=\"../Pics/Figures/A1.jpg\" target=\"_blank\">Al</a>, the full load performance (maximum power output, fuel consumption, smoke emission) is equivalent within the measurement accuracy. For the ECE R49 emissions, the same good overall level of engine out emissions was observed. The individual emission components are compared in fig. <a href=\"../Pics/Figures/A2.jpg\" target=\"_blank\">A2</a> and vary within the expected test-to-test variability of single test results.</p>\r\n              <p align=\"left\">It can be summarized that the use of TOHO 9000 did not influence engine performance and emission.<br>\r\n  The self-governed low idle speed of the engine was identical.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Endurance\"></a><b>3.2. Endurance Test Procedure</b></p>\r\n              <p align=\"left\">The engine test procedure used for the project is the 500 hours MAN test cycle, as shown in fig. <a href=\"../Pics/Figures/D1.jpg\" target=\"_blank\">Dl</a>.</p>\r\n              <p align=\"left\">This procedure was run 2 &#145;/2 times so that a total endurance test running time of 1250 hours was accumulated, which correlates to approximately 100.000 km of vehicle operation.<br>\r\n  Fig. <a href=\"../Pics/Figures/D2.jpg\" target=\"_blank\">D2</a> gives an overview of the test sequence carried out at AVL during the subject project. The lube oil filling volume of the engine is 21.6 liters approximately.</p>\r\n              <p align=\"left\"><b><a name=\"Chemical\"></a>3.3. Chemical Lube Oil Analysis Results of the 1250 Hours Endurance Test with TOHO 9000</b></p>\r\n              <p align=\"left\"><b><a name=\"General\"></a>3.3.1. General</b></p>\r\n              <p align=\"left\">Before starting the endurance tests, the engine was filled with Rimula I OW/30 containing 15% by weight TOHO 9000 as lube oil. After an oil sample was taken for the oil analysis, the same amount was refilled with fresh lube oil containing 15% by weight TOHO 9000, thereafter the natural engine oil consumption was topped with Rimula I OW/30 without TOHO 9000, see table 1.</p>\r\n              <p align=\"left\"><b>Table 1: Oil Additions</b></p>\r\n              <div align=\"left\">\r\n                <table width=\"90%\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n                  <tr>\r\n                    <th>&nbsp;</th>\r\n                    <th colspan=\"2\">Oil Sample Taken (ml)</th>\r\n                    <th colspan=\"2\">Oil Refilling Amount</th>\r\n                  </tr>\r\n                  <tr>\r\n                    <th>Engine Running Time (h)</th>\r\n                    <th>for LMB</th>\r\n                    <th>for AVL</th>\r\n                    <th>with TOHO (ml)</th>\r\n                    <th>without TOHO (g)</th>\r\n                  </tr>\r\n                  <tr>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">0</div></td>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">250</div></td>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">46</div></td>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">296</div></td>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">-</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">50</div></td>\r\n                    <td>\r\n                      <div align=\"center\">218</div></td>\r\n                    <td>\r\n                      <div align=\"center\">44</div></td>\r\n                    <td>\r\n                      <div align=\"center\">262</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2373</div>