align=\"center\">241</div></td>\r\n                    <td>\r\n                      <div align=\"center\">-</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">900</div></td>\r\n                    <td>\r\n                      <div align=\"center\">222</div></td>\r\n                    <td>\r\n                      <div align=\"center\">45</div></td>\r\n                    <td>\r\n                      <div align=\"center\">267</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2513</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">950</div></td>\r\n                    <td>\r\n                      <div align=\"center\">223</div></td>\r\n                    <td>\r\n                      <div align=\"center\">44</div></td>\r\n                    <td>\r\n                      <div align=\"center\">267</div></td>\r\n                    <td>\r\n                      <div align=\"center\">3535</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1000</div></td>\r\n                    <td>\r\n                      <div align=\"center\">212</div></td>\r\n                    <td>\r\n                      <div align=\"center\">48</div></td>\r\n                    <td>\r\n                      <div align=\"center\">260</div></td>\r\n                    <td>\r\n                      <div align=\"center\">3514</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1050</div></td>\r\n                    <td>\r\n                      <div align=\"center\">204</div></td>\r\n                    <td>\r\n                      <div align=\"center\">48</div></td>\r\n                    <td>\r\n                      <div align=\"center\">252</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2800</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1100</div></td>\r\n                    <td>\r\n                      <div align=\"center\">210</div></td>\r\n                    <td>\r\n                      <div align=\"center\">46</div></td>\r\n                    <td>\r\n                      <div align=\"center\">256</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2200</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1150</div></td>\r\n                    <td>\r\n                      <div align=\"center\">243</div></td>\r\n                    <td>\r\n                      <div align=\"center\">43</div></td>\r\n                    <td>\r\n                      <div align=\"center\">286</div></td>\r\n                    <td>\r\n                      <div align=\"center\">-</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1200</div></td>\r\n                    <td>\r\n                      <div align=\"center\">220</div></td>\r\n                    <td>\r\n                      <div align=\"center\">46</div></td>\r\n                    <td>\r\n                      <div align=\"center\">266</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2579</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1250</div></td>\r\n                    <td>\r\n                      <div align=\"center\">226</div></td>\r\n                    <td>\r\n                      <div align=\"center\">47</div></td>\r\n                    <td>\r\n                      <div align=\"center\">273</div></td>\r\n                    <td>\r\n                      <div align=\"center\">1135</div></td>\r\n                  </tr>\r\n                </table>\r\n              </div>              <p align=\"left\">The oil analysis was analysis out with oil samples taken after 0.5, 50, 100 ... 1250 hours engine<br>\r\n  running time. Viscosity at 40 and 100 0C, TBN, Insoluble\'s and wear metals were measured with<br>\r\n  Rimula TX I OW/30 + TOHO 9000 oil samples by AVL and Liebherr. Results with Rimula TX<br>\r\n  15W/40 oil samples without TOHO 9000 measured by Liebherr are also included in the figures.</p>\r\n              <p align=\"left\"><br>\r\n                  <b><a name=\"Viscosity\"></a>3.3.2. Viscosity, Insoluble\'s and Dispersant Efficiency</b><br>\r\n                  <br>\r\n  Adding TOHO 9000 to Rimula TX I 0W30 results in a viscosity increase to a SAE I 0W50 class and in a drop with a short running time of 50 hours to a SAE 1 0W40 class.</p>\r\n              <p align=\"left\">AVL&#146;s and LicbhcIT&#146;s results of viscosity at both temperatures (40 0C/fig. <a href=\"../Pics/Figures/B1.jpg\" target=\"_blank\">B1</a> and 100 0C/fig. <a href=\"../Pics/Figures/B2.jpg\" target=\"_blank\">B2</a>) show this significant decrease from zero to 50 hours running time and a very small further decrease up to Ca. 400 hours running time. From 400 hours running time, a slight viscosity increase in both temperatures appears, the lube oil class is still a SAE I 0W40 class. (Note: The engine oil consumption was compensated with a SAE 10W30 lube oil without TOHO. Nevertheless, the measured viscosity was a SAE I 0W40 oil.)</p>\r\n              <p align=\"left\">A completely contrary view is seen in the Liebherr results for the I 5W/40 lube oil without TOHO, where a relatively strong increase in viscosity is seen for the whole time period up to 500 hours running time.</p>\r\n              <p align=\"left\">However, a viscosity decrease during the first 50 hours running time can be explained either by an oil dilution with fuel or by the shearing of high molecular compounds to lower molecular ones, but we are not familiar if TOHO 9000 contains high molecular compounds. In order to demonstrate a possible oil dilution, the boiling point distribution of samples was measured by simulated distillation in gas chromatography. No oil dilution with the fuel was detected but a depletion of TOHO 9000 or some compounds of TOHO 9000 as demonstrated in fig. <a href=\"../Pics/Figures/B3.jpg\" target=\"_blank\">B3</a>. On the other hand, a more or less stable viscosity increase with running time as seen with the standard Rimula TX15W/40 lube oil in figs. <a href=\"../Pics/Figures/B1.jpg\" target=\"_blank\">B1</a> and <a href=\"../Pics/Figures/B2.jpg\" target=\"_blank\">B2</a> has never been observed at AVL to date. A viscosity increase in diesel engine oils is normally seen if the insoluble content of the oil amounts to 2% and more according to AVL&#146;s experience, and this can be confirmed by the insoluble slopes in fig. <a href=\"../Pics/Figures/B4.jpg\" target=\"_blank\">B4</a>.</p>\r\n              <p align=\"left\">The insoluble\'s were measured by infrared spectrometer (JR). By the way, the IR-spectra show a reduction of absorbence frequency at ca. 1740 cm&#146; wave number (&#151; 5.75 pm) caused by the topping up with lube oil without TOHO and/or by a degradation of compounds containing C = 0 groups. The measured peak minima are shown in fig. <a href=\"../Pics/Figures/B5.jpg\" target=\"_blank\">B5</a>. The C = 0 degradation became larger and larger and was no longer measurable at running times of more than 500 hours. Carbonyl (C 0) compounds are used as dispersant additives in some lube oil formulations, but may also contribute to TOHO 9000. However, as shown by the drop tests (fig. <a href=\"../Pics/Figures/B6.jpg\" target=\"_blank\">B6</a>), the dispersant activity of the lube oil containing TOHO 9000 is still excellent after 1250 hrs. engine running time.</p>\r\n              <p align=\"left\"><b><a name=\"TBN\"></a>3.3.3. TBN</b><br>\r\n  The total base number (TBN) was measured according to ASTM-D-2896 - the perchloric acid procedure - by Liebherr and AVL as well as to ASTM-D-664 - the hydrochloric acid procedure -by AVL only. fig. <a href=\"../Pics/Figures/B7.jpg\" target=\"_blank\">B7</a>.</p>\r\n              <p align=\"left\">Normally, both methods yield the same TBN value for fresh oils, but show different diagrams<br>\r\n  over running time (which means increasing oil aging). While TBN values measured by ASTM-D-664 decrease over running time - due to neutralization of strong acids formed during combustion<br>\r\n  - an TBN increase measured by ASTM-D-2896 can sometimes be observed - an oxidation of<br>\r\n  wear metals occurs by perchloiic acid.</p>\r\n              <p align=\"left\">Fig. <a href=\"../Pics/Figures/B7.jpg\" target=\"_blank\">B7</a> shows the same TBN number of Rimula 1 5W/40 without TOHO (Licbherr ASTM-D-2896) and I 0W130 lube oil with TOHO (AVL ASTM-D-664). In case of the ASTM-D-2896 measurements of the I OW/30 lube oil with TOHO 9000. AVL and Licbhen found higher TBN numbers for the fresh oil compared to the ASTM-D-664 procedure. but both methods gave the same TBN number in fresh oils without TOHO 9000 when measured in the AVL lab.</p>\r\n              <p align=\"left\">However, the ASTM-D-664 procedure shows an unusually flat TBN depletion up to around 500 hours and a relatively stable slope with further running time, but in any case, the TBN degradation is unusually low (also see fig. <a href=\"../Pics/Figures/C13.jpg\" target=\"_blank\">C13</a>) and no problems even after 1250 hours endurance testing are indicated.</p>\r\n              <p align=\"left\"><br>\r\n                  <b><a name=\"Wear\"></a>3.3.4. Wear Metals</b><br>\r\n  Wear metals were measured by atomic emission spectrometer in ppm per sample. When topping up, the ppm value is lowered, but the real wear must more or less show a constant increase with running time for given driving conditions. Therefore, the wear is calculated in mg out of the measured ppm value as if no lube oil is consumed by the engine and no topping up has taken place.</p>\r\n              <p align=\"left\">After an initial increase, the ppm iron for example seems to be constant by around 80 ppm after ca 500 hours running time (fig. <a href=\"../Pics/Figures/b8.jpg\" target=\"_blank\">B8</a>). Compared to this, the mg iron is approx. linearly increased with running time (fig. <a href=\"../Pics/Figures/b9.jpg\" target=\"_blank\">B9</a>) and this means the real wear. The wear rates of iron up to 500 hours running time is comparable for all lube oils, therefore no advantage of TOHO 9000 was found. For copper, the ppm reading in fig. <a href=\"../Pics/Figures/B10.jpg\" target=\"_blank\">B10</a> and the calculated mg in fig. <a href=\"../Pics/Figures/B11.jpg\" target=\"_blank\">B11</a> showed no linear increased in mg and this indicates a damage, in this case caused by an experimental bushing of the injection pump drive gear. The slopes of all other metals in mg vs. running time were found linear and do not indicate any problems (also see fig. <a href=\"../Pics/Figures/C11.jpg\" target=\"_blank\">C11</a>).</p>\r\n              <p align=\"left\"><br>\r\n                  <b><a name=\"VisualInspection\"></a>3.4. Visual Inspection of the Main Engine Components after the 1250 Hours Test with TOHO 9000</b></p>\r\n              <p align=\"left\">After the endurance test run, the engine was disassembled for a visual inspection of the main engine components. This work was done in close cooperation with the engine manufacturer to rely on his experience with engines of the same type running the same endurance test cycle.</p>\r\n              <p align=\"left\">Fig. <a href=\"../Pics/Figures/E1.jpg\" target=\"_blank\">El</a> gives a summary of the assessment of the main engine components such as valves, intake and exhaust ports and manifolds and pistons in order to quantity~&#146; the visual impression of the buildup of carbon deposits.</p>\r\n              <p align=\"left\">The engine run after 1250 hours with TOHO is judged in the right column with a total of 8 points (minimum and thus best results possible is 7 points).</p>\r\n              <p align=\"left\">The visual condition of the main engine parts is illustrated in figs. <a href=\"../Pics/Figures/E2.jpg\" target=\"_blank\">E2</a>,<a href=\"../Pics/Figures/E3.jpg\" target=\"_blank\">E3</a>,<a href=\"../Pics/Figures/E4.jpg\" target=\"_blank\">E4</a>,<a href=\"../Pics/Figures/E5.jpg\" target=\"_blank\">E5</a>,<a href=\"../Pics/Figures/E6.jpg\" target=\"_blank\">E6</a>,<a href=\"../Pics/Figures/E7.jpg\" target=\"_blank\">E7</a>,<a href=\"../Pics/Figures/E8.jpg\" target=\"_blank\">E8</a>,<a href=\"../Pics/Figures/E9.jpg\" target=\"_blank\">E9</a>, featuring photographs of the original assessment report of the engine manufacturer.</p>\r\n              <p align=\"left\">The visual inspection of the main engine pails can be summarized as follows:</p>\r\n              <div align=\"left\">\r\n                <table width=\"90%\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n                  <tr>\r\n                    <td width=\"18%\">Engine block:</td>\r\n                    <td width=\"82%\">clean, normal deposits</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Gear housing:</td>\r\n                    <td width=\"82%\">clean, normal deposits</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Cylinder liners:</td>\r\n                    <td width=\"82%\"><br>\r\n        good condition, no indication of bore polishing, honing pattern clearly visible</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Piston:</td>\r\n                    <td width=\"82%\">coked deposits on piston ring top land, first ring groove clean with minor deposits, good condition according to piston manufacturer</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Piston rings:</td>\r\n                    <td width=\"82%\">good condition, no excessive wear</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Con rod:</td>\r\n                    <td width=\"82%\">small and big end bearing, normal wear</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Crankshaft:</td>\r\n                    <td width=\"82%\">no visible wear on main journal and con rod journal</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Camshaft:</td>\r\n                    <td width=\"82%\">Normal wear relative to running time:<br>\r\n        wear after 1250 hours with TOHO: 0.201/0.261 mm wear after 500 hours w/o TOHO: 0.104/0.103 mm for intake and exhaust cam</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">\r\n                      <p></p>\r\n                      <p>Tappets:</p></td>\r\n                    <td width=\"82%\">no visible wear</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Rocker arms:</td>\r\n                    <td width=\"82%\">wear on contact area normal relative to running time:<br>\r\n        wear after 1250 hours with TOHO: 0.030/0.101 mm wear after 500 hours w/o TOHO: 0.042(?)/0.042 mm for intake and exhaust rocker arm</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">\r\n                      <p></p>\r\n                      <p>Valves:</p></td>\r\n                    <td width=\"82%\">carbon deposits on intake valve, no deposits on exhaust valve</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Oil pan:</td>\r\n                    <td width=\"82%\">rough layer on horizontal surfaces, clean vertical surfaces.</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Turbocharger:</td>\r\n                    <td width=\"82%\">layer on compressor housing inner surface</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Valve clearance:</td>\r\n                    <td width=\"82%\">0.35-0.45 for intake valve<br>\r\n        0.5 5-0.60 for exhaust valve after 1250 hours w/o readjustment</td>\r\n                  </tr>\r\n                </table>\r\n              </div>              <p align=\"left\">It can be concluded that the visual condition of the engine after 1250 running hours with TOHO concerning visual wear and buildup of deposits is equal or better compared to the engine run without an oil change for 500 hours using standard Rimula TXI 5W40 lube oil w/o TOHO.</p>\r\n              <p align=\"left\">A comparable engine run over 500 hours with the recommended oil change after 250 hours has been judged to be only marginally better.</p>\r\n              <p align=\"left\"><br>\r\n                  <b><a name=\"FurtherEndurance\"></a>3.5. Further Endurance Test Results</b></p>\r\n              <p align=\"left\"><b>Full load performance and emissions versus running time</b></p>\r\n              <p align=\"left\">The engine full load performance and emission status of the engine was regularly checked during the 1250 hours of the endurance test run. Fig. <a href=\"../Pics/Figures/C1.jpg\" target=\"_blank\">C1</a> shows the comparison of the engine full load performance before the endurance test and after 1250 hours. A summary of the maximum power</p>\r\n              <p align=\"left\">of the engine versus the endurance test time is given in fig. <a href=\"../Pics/Figures/C7.jpg\" target=\"_blank\">C7</a>. Figs. <a href=\"../Pics/Figures/C2.jpg\" target=\"_blank\">C2</a>,<a href=\"../Pics/Figures/C3.jpg\" target=\"_blank\">C3</a>,<a href=\"../Pics/Figures/C4.jpg\" target=\"_blank\">C4</a>,<a href=\"../Pics/Figures/C5.jpg\" target=\"_blank\">C5</a>,<a href=\"../Pics/Figures/C6.jpg\" target=\"_blank\">C6</a> compare the full load performance of the engine and Fig. <a href=\"../Pics/Figures/C8.jpg\" target=\"_blank\">C8</a> the emissions in the ECE R49 cycle in steps of 250 hours.</p>\r\n              <p align=\"left\">None of these results indicated any abnormal engine behavior.</p>\r\n              <p align=\"left\">As no statistically valid scatter band of results obtained on the same engine type running the same cycle and duration without using TOHO is available, the data cannot be correlated to the use of<br>\r\n  TOHO 9000.</p>\r\n              <p align=\"left\">Blowby versus running time</p>\r\n              <p align=\"left\">The engine blowby, the gas leaking mainly around the piston rings into the crank case is shown in figs. <a href=\"../Pics/Figures/C9.jpg\" target=\"_blank\">C9</a> and <a href=\"../Pics/Figures/C10.jpg\" target=\"_blank\">C1O</a> for three different engine speeds at full load conditions.</p>\r\n              <p align=\"left\">After refilling the engine with the mixture of standard oil plus TOHO 9000, the blowby dropped by 5 to 8% within the first 6 running hours when compared to the results when using standard I 5W40 and I 0W30 lube oils.</p>\r\n              <p align=\"left\">These results indicate a positive effect of TOHO 9000 on the sealing capability of the piston ring - cylinder liner area.</p>\r\n              <p align=\"left\">Wear metals versus running time</p>\r\n              <p align=\"left\">Figs. <a href=\"../Pics/Figures/C11.jpg\" target=\"_blank\">C11</a> and <a href=\"../Pics/Figures/C12.jpg\" target=\"_blank\">C12</a>.</p>\r\n              <p align=\"left\">The wear metals found in the lube oil show a similar trend for the endurance test engine using TOHO 9000 and the comparison engine run at LMB without TOHO as shown in fig. <a href=\"../Pics/Figures/C12.jpg\" target=\"_blank\">C12</a>. In this graph the LMB-analysis results by VERNOLAB/France are cross plotted</p>\r\n              <p align=\"left\">No indication for a change of the engine wear when using TOHO 9000 was found.</p>\r\n              <p align=\"left\">A very linear trend of the engine wear versus the test period indicates no problem on any main engine component.</p>\r\n              <p align=\"left\">The increase of copper after about 800 running hours is due to higher wear on one experimental part of the engine fuel injection pump drive and is thus not to be correlated with the use of TOHO (also see chapter 3.3.4).</p>\r\n              <p align=\"left\">Comparison of TBN</p>\r\n              <p align=\"left\">Fig. <a href=\"../Pics/Figures/C13.jpg\" target=\"_blank\">C13</a> shows the degradation of the total base number of the lube oil of the endurance test with TOHO in comparison with the usually experienced degradation of standard oils. Although this comparison is not scientifically correct because it is based on different engines (swept volume 3 to 12 liters) and test cycles (full load cycle, thermo shock cycle), the general trend of an unusually low degradation of TBN can be illustrated.</p>\r\n              <p align=\"left\">Oil consumption</p>\r\n              <p align=\"left\">The oil consumption of the engine was monitored during the whole test period and is presented in detail in figs. <a href=\"../Pics/Figures/C14.jpg\" target=\"_blank\">C14</a>,<a href=\"../Pics/Figures/C15.jpg\" target=\"_blank\">C15</a>,<a href=\"../Pics/Figures/C16.jpg\" target=\"_blank\">C16</a>,<a href=\"../Pics/Figures/C17.jpg\" target=\"_blank\">C17</a>,<a href=\"../Pics/Figures/C18.jpg\" target=\"_blank\">C18</a>.</p>\r\n              <p align=\"left\"><br>\r\n  Fig. <a href=\"../Pics/Figures/C17.jpg\" target=\"_blank\">C17</a> shows the trend of the rated power lube oil consumption in terms of (g/h) versus the endurance test running time.</p>\r\n              <p align=\"left\">A dramatically increased oil consumption was observed at approximately 600 hours whilst after<br>\r\n  750 hours the oil consumption improved continuously and at 1250 hours the level even nearly<br>\r\n  reached the initial values again.</p>\r\n              <p align=\"left\">The reason is unknown, moreover at the same time also the engine full load smoke and fuel consumption as well as the engine R49 emission results deteriorated simultaneously and improved again later on.</p>\r\n              <p align=\"left\">As shown in figs. <a href=\"../Pics/Figures/C14.jpg\" target=\"_blank\">C14</a>,<a href=\"../Pics/Figures/C15.jpg\" target=\"_blank\">C15</a>,<a href=\"../Pics/Figures/C16.jpg\" target=\"_blank\">C16</a>, the natural lube oil consumption of the engine over the 1250 hours endurance test amounted to 63.5 liters, which is approximately 3 times the total oil filling volume of the engine 21.6L).</p>\r\n              <p align=\"left\">For fig. 18, showing the engine map lube oil consumption, it has to be mentioned that the measurement was, unfortunately, taken at the time of the highest lube oil consumption, but no other time window was available because of the tight schedule.</p>\r\n              <p align=\"left\">The map oil consumption was measured using AVL&#146;s oil consumption meter 403S.</p>\r\n              <p align=\"left\">In any way, the lube oil consumption results too cannot be correlated to the use of TOHO 9000 because no comparison data (statistical scatter band) of the same engine type operated without using TOHO along the same cycle and for the same running period is available.</p>              \r\n              <p align=\"left\" class=\"style2\">&nbsp;</p>\r\n            <div align=\"center\"></div></td>\r\n          </tr>\r\n          <tr>\r\n            <td height=\"70\" valign=\"top\"><img src=\"../Pics/toho9000layout2_10.gif\" width=\"748\" height=\"70\"></td>\r\n          </tr>\r\n          <tr>\r\n            <td height=\"33\" background=\"../Pics/bottom_bg.gif\" class=\"top-links\"><div align=\"center\" class=\"main_menu\"><a href=\"../index.html\">Home</a> | <a href=\"../Products.php\">Products</a> | <a href=\"../TestResults.htm\">Tests</a> | <a href=\"../SavingAnalysis.htm\">Analysis</a> | <a href=\"../Environment.php\">Environment</a> | <a href=\"../Research.htm\">Research</a> | <a href=\"../video.htm\">Video</a> | <a href=\"../cart/front/order.php\">Order Now</a> | <a href=\"../ContactUs.php\">Contact Us</a> </div></td>\r\n          </tr>\r\n            </table>', 'No'),
(3136, 362, '<p align=\"left\">Date : 7.NOV.1996<br>\r\n  Subject : TOHO 9000 - 1250 Hours Endurance Test at AVL</p>\r\n              <p align=\"left\">Dear Mr. Lim,</p>\r\n              <p align=\"left\">This is to confirm that by request of TOHO International Pte Ltd. of Singapore, AVL has carried out endurance tests for 1250 with TOHO 9000 in accordance with the MAN 500 test procedure equivalent to a vehicle running distance of approximately 100,000 km. This procedure is a well known test for European engine manufacturers and has been carried out with one of the leading 10L European heavy duty engines with a rated power output of 230kW (313 PS). Based on the results of lube oil analysis (wear metal content, TBN, viscosity, insoluble\'s) Having been monitored throughout the whole test period, the engine with TOHO 9000 and regularly topped up with standard oil did stand for at least 100,000 km without any irregularities.</p>\r\n              <p align=\"left\">Sincerely yours,<br>\r\n  AVL LIST GMBH</p>\r\n              <p align=\"left\">----------------</p>\r\n            <p align=\"left\">M. Egert</p> ', 'No');
INSERT INTO `mod_text` (`id`, `content_pagesID`, `content_text`, `sidebar_content`) VALUES
(3137, 363, '<h2 align=\"center\">Endurance Test with TOHO 9000 Oil Additive on the Liebherr D926 TI-E Engine </h2>\r\n              <p align=\"center\"><b>(Bore x Stroke: 122 x 142 mm) Final Report</b></p>\r\n              <p align=\"left\">Contents</p>\r\n              <p align=\"left\">1. <a href=\"#intro\" target=\"_self\">Introduction</a></p>\r\n              <p align=\"left\">2. <a href=\"#Summary\">Summary and Conclusions</a></p>\r\n              <div align=\"left\">\r\n                <blockquote>&nbsp;\r\n                </blockquote>\r\n              </div>              <blockquote><p align=\"left\">2.1. <a href=\"#Comparison\">Comparison of the Engine Performance and Emissions with- and without TOHO 9000</a><br>\r\n    2.2. <a href=\"#Lube\">Lube Oil Analysis Results</a><br>\r\n    2.3. <a href=\"#Visual\">Visual Inspection</a><br>\r\n    2.4. <a href=\"#Further\">Further Endurance Test Results</a><br>\r\n    2.5. <a href=\"#Conclusions\">Conclusions</a><br>\r\n                </p>\r\n              </blockquote>\r\n              <p align=\"left\">3. <a href=\"#Test\">Test Results</a></p>\r\n              <div align=\"left\">\r\n                <blockquote>&nbsp;\r\n                </blockquote>\r\n              </div>              <blockquote><p align=\"left\">3.1. <a href=\"#ComparisonTests\">Comparison Tests (Engine with and w/o TOHO)</a><br>\r\n    3.2. <a href=\"#Endurance\">Endurance Test Procedure</a><br>\r\n    3.3. <a href=\"#Chemical\">Chemical Lube Oil Analysis Results of the 1250 Hours Endurance Test with TOHO 9000</a><br>\r\n    3.3.1. <a href=\"#General\">General</a><br>\r\n    3.3.2. <a href=\"#Viscosity\">Viscosity, Insoluble\'s and Dispersant Efficiency</a><br>\r\n    3.3.3. <a href=\"#TBN\">TBN</a><br>\r\n    3.3.4. <a href=\"#Wear\">Wear Metals</a><br>\r\n    3.4. <a href=\"#VisualInspection\">Visual Inspection of the Main Engine Components after the 1250 Hours Test with TOHO 9000</a><br>\r\n    3.5. <a href=\"#FurtherEndurance\">Further Endurance Test Results</a></p>\r\n              </blockquote>\r\n              <p align=\"left\"><a name=\"Intro\"></a><b>1. Introduction</b></p>\r\n              <p align=\"left\"><br>\r\n  Based on the agreement between TOHO International Pte Ltd. and AVL dated 04-June-I 996, AVL was performing an engine durability program with the lube oil additive TOHO 9000 in order to demonstrate its long term effects on lube oil aging behavior (viscosity, TBN, Insoluble\'s, wear metal content etc. indicative for oil change intervals) as well as on engine performance and emissions.</p>\r\n              <p align=\"left\">&nbsp;</p>\r\n              <div align=\"left\">\r\n                <table width=\"90%\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n                  <tr>\r\n                    <th colspan=\"2\">The engine used was the series production LIEBHERR D926 TI-E heavy-duty L-6 cylinder D.I. diesel engine:</th>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Bore x stroke: </td>\r\n                    <td>122 x 142 mm</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Swept volume:</td>\r\n                    <td>9.96 liter</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Water-cooled, turbo charged. Air/air inter cooled<br>\r\n        Power rating: </td>\r\n                    <td>230 kW at 2100 rpm</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Max. torque:</td>\r\n                    <td>1200-1235 Nm at 1400-1600 rpm</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>Emission status: </td>\r\n                    <td>EURO 2</td>\r\n                  </tr>\r\n                              </table>\r\n              </div>              <p align=\"left\">The test procedure was the MAN 500 hours test which includes constant load phases at rated power and peak torque and intermittent load phases (low idle to rated power).<br>\r\n  This test procedure was run two and a half times accumulating a total endurance test running time of 1250 hours which is equivalent to a vehicle running distance of approximately 100.000 km.</p>\r\n              <p align=\"left\"><br>\r\n  An identical engine was run at LMB (LiebhelT Machines Bulle) for 500 hours with standard lube oil without any additional additive and the results will be compared to those of AVL&#146;s test with<br>\r\n  TOHO 9000.</p>\r\n              <p align=\"left\">The 1250 hours test at AVL was performed without an oil change whilst the regular interval for changing the engine lube oil is 250 hours according to the engine manufacturer&#146;s standards. A mixture of 85% standard lube oil (Shell Rimula TX 10W30) and 15% TOHO 9000 was used (15% TOHO is more a blending component than an additive, however we name it &#147;additive&#148;). The oil consumed was regularly topped up with standard lube oil whilst the amount of oil taken out every 50 hours for the chemical analysis was replaced with the mixture.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Summary\"></a><b>2. Summary and Conclusions</b><br>\r\n  The results obtained during the subject test program are split up and summarized as follows:</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Comparison\"></a><b>2.1. Comparison of the Engine Performance and Emissions with- and without TOHO 9000</b></p>\r\n              <p align=\"left\">The comparison test was run at AVL before the endurance test program with the identical engine under exactly the same engine operating and similar ambient boundary conditions. Therefore, a conclusive judgment can be made:</p>\r\n              <p align=\"left\"> <b>Full load performance</b></p>\r\n              <p align=\"left\">The maximum power output, the fuel consumption and smoke emission is equivalent within the measurement accuracy.</p>\r\n              <p align=\"left\">The blowby of the engine dropped by approximately 5-8% under high speed/full load conditions, indicating some positive effect of TOHO 9000 with respect to the scaling capabilities of the piston-piston ring - cylinder liner area.</p>\r\n              <p align=\"left\"><b>ECE R49 emission test</b></p>\r\n              <p align=\"left\">Overall the same good level of engine-out emissions was observed for all measured emission components (NOx, HC, CO, particulates).</p>\r\n              <p align=\"left\"><a name=\"Lube\"></a><b>2.2. Lube Oil Analysis Results</b></p>\r\n              <p align=\"left\">The oil analysis (TBN, viscosity, Insoluble\'s and wear metals) does not indicate any problems after 1250 hours running time.</p>\r\n              <p align=\"left\">TBN (ASTM-D-664 procedure) of the lube oil with 15% TOHO 9000 shows an unusually low degradation even after 1250 hours running time.</p>\r\n              <p align=\"left\">Adding TOHO 9000 to a SAE 10W30 lube oil results in a viscosity increase to a SAE 10W50 lube oil class and a drop with a short running time of 50 hours to a SAE 10W40 class oil. The viscosity was then stable within the SAE I 0W40 class up to 1250 hours running time.</p>\r\n              <p align=\"left\">The Dispersant activity of the lube oil containing TOHO 9000 is still excellent after 1250 hrs. engine running time.</p>\r\n              <p align=\"left\">Wear metals show a normal more or less linear increase in mg metal and this means TOHO 9000 does not influence engine wear.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Visual\"></a><b>2.3. Visual Inspection</b></p>\r\n              <p align=\"left\">From the visual inspection of the main engine components such as engine block, cylinder liner, pistons, piston rings, valves, manifolds etc. of the engine run for 1250 hours along the MAN endurance test cycle, it can be concluded that:</p>\r\n              <div align=\"left\">\r\n                <ul>\r\n                  <li> The visual condition of the engine with respect to visual engine wear and the buildup of deposits is equal or better compared to the engine run without an oil change for 500 hours using a similar standard oil without TOHO.</li>\r\n                    <li>A comparable engine run over 500 hours with the same oil and with the recommended oil change after 250 hours has been judged to be only marginally better.</li>\r\n                    <li>None of the engine components showed irregular or abnormal wear relative to the running time accumulated on the engine</li>\r\n                </ul>\r\n              </div>              <p align=\"left\">. </p>\r\n              <p align=\"left\">Taking into account that a standard lube oil - Shell Rimula TX 1 0W30 containing 15% of TOHO 9000 - had been used without an oil change and without changing the oil filter over 1250 hours along a quite severe test procedure, the visual condition of the engine was judged to be very good.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Further\"></a><b>2.4. Further Endurance Test Results</b></p>\r\n              <p align=\"left\">The engine full load performance and emissions as well as the lube oil consumption was recorded along the endurance test period in regular intervals of 250 hours.</p>\r\n              <p align=\"left\">A total amount of 63.5 liters lube oil (TX 1 0W30 w/o TOHO) had to be refilled over the running time of 1250 hours to compensate the natural lube oil consumption. This is approximately 3 times the oil filling volume of the subject engine.</p>\r\n              <p align=\"left\">None of the results indicated any abnormal engine behavior.</p>\r\n              <p align=\"left\">As no comparison data of engines of the same type run over the same running time and test cycle without TOHO are available (statistical scatter band), the obtained engine results cannot be correlated to the use of TOHO 9000 and figure as additional information only.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Conclusions\"></a><b>2.5. Conclusions</b><br>\r\n  Based on the lube oil analysis as well as on the visual inspection results of the engine main components, an extension of the running time to more than 1250 hours can be recommended.</p>\r\n              <p align=\"left\">No negative influence of the use of TOHO 9000 with respect to engine wear, power output or engine emissions arc indicated.</p>\r\n              <p align=\"left\"><a name=\"Test\"></a><b>3. Test Results</b></p>\r\n              <p align=\"left\"><a name=\"ComparisonTests\"></a><b>3.1. Comparison Tests (Engine with and w/o TOHO)</b></p>\r\n              <p align=\"left\">Before the start of the endurance test program, it was agreed to compare the engine full load and ECE R49 emission results of the Liebheii D926 TI-E engine using a standard lube oil first and then a mixture of 85% standard lube oil plus 15% TOHO 9000.</p>\r\n              <p align=\"left\">As standard oil Rimula TX 15W40 and 10W30 oils were used (see fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/D3.jpg\" target=\"_blank\">D3</a>). Because the results just differ within the measurement accuracy, only the latter has been used for comparison. Subsequently, the oil was drained and replaced by a mixture of 85% Rimula TX 1 0W30 and 15% TOHO 9000. The engine was warmed up for approx. 15 minutes under idling conditions to assure a good mixing and after 6 hours running at various loads, the comparison full load test was performed.</p>\r\n              <p align=\"left\">As these tests have been carried out with the identical engine and the engine operating conditions (such as engine speed, boost pressure and temperature, fuel and oil temperature as well as coolant temperature etc.) were kept constant and also the ambient conditions (ambient temperature, barometric pressure) were similar, the obtained results allow conclusive judgments:<br>\r\n  As illustrated in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/A1.jpg\" target=\"_blank\">Al</a>, the full load performance (maximum power output, fuel consumption, smoke emission) is equivalent within the measurement accuracy. For the ECE R49 emissions, the same good overall level of engine out emissions was observed. The individual emission components are compared in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/A2.jpg\" target=\"_blank\">A2</a> and vary within the expected test-to-test variability of single test results.</p>\r\n              <p align=\"left\">It can be summarized that the use of TOHO 9000 did not influence engine performance and emission.<br>\r\n  The self-governed low idle speed of the engine was identical.</p>\r\n              <p align=\"left\"><br>\r\n                  <a name=\"Endurance\"></a><b>3.2. Endurance Test Procedure</b></p>\r\n              <p align=\"left\">The engine test procedure used for the project is the 500 hours MAN test cycle, as shown in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/D1.jpg\" target=\"_blank\">Dl</a>.</p>\r\n              <p align=\"left\">This procedure was run 2 &#145;/2 times so that a total endurance test running time of 1250 hours was accumulated, which correlates to approximately 100.000 km of vehicle operation.<br>\r\n  Fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/D2.jpg\" target=\"_blank\">D2</a> gives an overview of the test sequence carried out at AVL during the subject project. The lube oil filling volume of the engine is 21.6 liters approximately.</p>\r\n              <p align=\"left\"><b><a name=\"Chemical\"></a>3.3. Chemical Lube Oil Analysis Results of the 1250 Hours Endurance Test with TOHO 9000</b></p>\r\n              <p align=\"left\"><b><a name=\"General\"></a>3.3.1. General</b></p>\r\n              <p align=\"left\">Before starting the endurance tests, the engine was filled with Rimula I OW/30 containing 15% by weight TOHO 9000 as lube oil. After an oil sample was taken for the oil analysis, the same amount was refilled with fresh lube oil containing 15% by weight TOHO 9000, thereafter the natural engine oil consumption was topped with Rimula I OW/30 without TOHO 9000, see table 1.</p>\r\n              <p align=\"left\"><b>Table 1: Oil Additions</b></p>\r\n              <div align=\"left\">\r\n                <table width=\"90%\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n                  <tr>\r\n                    <th>&nbsp;</th>\r\n                    <th colspan=\"2\">Oil Sample Taken (ml)</th>\r\n                    <th colspan=\"2\">Oil Refilling Amount</th>\r\n                  </tr>\r\n                  <tr>\r\n                    <th>Engine Running Time (h)</th>\r\n                    <th>for LMB</th>\r\n                    <th>for AVL</th>\r\n                    <th>with TOHO (ml)</th>\r\n                    <th>without TOHO (g)</th>\r\n                  </tr>\r\n                  <tr>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">0</div></td>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">250</div></td>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">46</div></td>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">296</div></td>\r\n                    <td height=\"17\">\r\n                      <div align=\"center\">-</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">50</div></td>\r\n                    <td>\r\n                      <div align=\"center\">218</div></td>\r\n                    <td>\r\n                      <div align=\"center\">44</div></td>\r\n                    <td>\r\n                      <div align=\"center\">262</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2373</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">100</div></td>\r\n                    <td>\r\n                      <div align=\"center\">225</div></td>\r\n                    <td>\r\n                      <div align=\"center\">46</div></td>\r\n                    <td>\r\n                      <div align=\"center\">271</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2371</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">150</div></td>\r\n                    <td>\r\n                      <div align=\"center\">230</div></td>\r\n                    <td>\r\n                      <div align=\"center\">46</div></td>\r\n                    <td>\r\n                      <div align=\"center\">276</div></td>\r\n                    <td>\r\n                      <div align=\"center\">1834</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">200</div></td>\r\n                    <td>\r\n                      <div align=\"center\">230</div></td>\r\n                    <td>\r\n                      <div align=\"center\">45</div></td>\r\n                    <td>\r\n                      <div align=\"center\">275</div></td>\r\n                    <td>\r\n                      <div align=\"center\">796</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">250</div></td>\r\n                    <td>\r\n                      <div align=\"center\">210</div></td>\r\n                    <td>\r\n                      <div align=\"center\">47</div></td>\r\n                    <td>\r\n                      <div align=\"center\">257</div></td>\r\n                    <td>\r\n                      <div align=\"center\">1457</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">300</div></td>\r\n                    <td>\r\n                      <div align=\"center\">207</div></td>\r\n                    <td>\r\n                      <div align=\"center\">48</div></td>\r\n                    <td>\r\n                      <div align=\"center\">255</div></td>\r\n                    <td>\r\n                      <div align=\"center\">1730</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">350</div></td>\r\n                    <td>\r\n                      <div align=\"center\">215</div></td>\r\n                    <td>\r\n                      <div align=\"center\">48</div></td>\r\n                    <td>\r\n                      <div align=\"center\">263</div></td>\r\n                    <td>\r\n                      <div align=\"center\">1503</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">400</div></td>\r\n                    <td>\r\n                      <div align=\"center\">207</div></td>\r\n                    <td>\r\n                      <div align=\"center\">47</div></td>\r\n                    <td>\r\n                      <div align=\"center\">254</div></td>\r\n                    <td>\r\n                      <div align=\"center\">1350</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td height=\"13\">\r\n                      <div align=\"center\">450</div></td>\r\n                    <td height=\"13\">\r\n                      <div align=\"center\">205</div></td>\r\n                    <td height=\"13\">\r\n                      <div align=\"center\">45</div></td>\r\n                    <td height=\"13\">\r\n                      <div align=\"center\">250</div></td>\r\n                    <td height=\"13\">\r\n                      <div align=\"center\">3450</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">500</div></td>\r\n                    <td>\r\n                      <div align=\"center\">210</div></td>\r\n                    <td>\r\n                      <div align=\"center\">48</div></td>\r\n                    <td>\r\n                      <div align=\"center\">258</div></td>\r\n                    <td>\r\n                      <div align=\"center\">4100</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">550</div></td>\r\n                    <td>\r\n                      <div align=\"center\">235</div></td>\r\n                    <td>\r\n                      <div align=\"center\">45</div></td>\r\n                    <td>\r\n                      <div align=\"center\">280</div></td>\r\n                    <td>\r\n                      <div align=\"center\">4850</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">600</div></td>\r\n                    <td>\r\n                      <div align=\"center\">220</div></td>\r\n                    <td>\r\n                      <div align=\"center\">45</div></td>\r\n                    <td>\r\n                      <div align=\"center\">265</div></td>\r\n                    <td>\r\n                      <div align=\"center\">4695</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">650</div></td>\r\n                    <td>\r\n                      <div align=\"center\">230</div></td>\r\n           