n                    <td>\r\n                      <div align=\"center\">41</div></td>\r\n                    <td>\r\n                      <div align=\"center\">241</div></td>\r\n                    <td>\r\n                      <div align=\"center\">-</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">900</div></td>\r\n                    <td>\r\n                      <div align=\"center\">222</div></td>\r\n                    <td>\r\n                      <div align=\"center\">45</div></td>\r\n                    <td>\r\n                      <div align=\"center\">267</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2513</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">950</div></td>\r\n                    <td>\r\n                      <div align=\"center\">223</div></td>\r\n                    <td>\r\n                      <div align=\"center\">44</div></td>\r\n                    <td>\r\n                      <div align=\"center\">267</div></td>\r\n                    <td>\r\n                      <div align=\"center\">3535</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1000</div></td>\r\n                    <td>\r\n                      <div align=\"center\">212</div></td>\r\n                    <td>\r\n                      <div align=\"center\">48</div></td>\r\n                    <td>\r\n                      <div align=\"center\">260</div></td>\r\n                    <td>\r\n                      <div align=\"center\">3514</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1050</div></td>\r\n                    <td>\r\n                      <div align=\"center\">204</div></td>\r\n                    <td>\r\n                      <div align=\"center\">48</div></td>\r\n                    <td>\r\n                      <div align=\"center\">252</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2800</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1100</div></td>\r\n                    <td>\r\n                      <div align=\"center\">210</div></td>\r\n                    <td>\r\n                      <div align=\"center\">46</div></td>\r\n                    <td>\r\n                      <div align=\"center\">256</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2200</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1150</div></td>\r\n                    <td>\r\n                      <div align=\"center\">243</div></td>\r\n                    <td>\r\n                      <div align=\"center\">43</div></td>\r\n                    <td>\r\n                      <div align=\"center\">286</div></td>\r\n                    <td>\r\n                      <div align=\"center\">-</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1200</div></td>\r\n                    <td>\r\n                      <div align=\"center\">220</div></td>\r\n                    <td>\r\n                      <div align=\"center\">46</div></td>\r\n                    <td>\r\n                      <div align=\"center\">266</div></td>\r\n                    <td>\r\n                      <div align=\"center\">2579</div></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td>\r\n                      <div align=\"center\">1250</div></td>\r\n                    <td>\r\n                      <div align=\"center\">226</div></td>\r\n                    <td>\r\n                      <div align=\"center\">47</div></td>\r\n                    <td>\r\n                      <div align=\"center\">273</div></td>\r\n                    <td>\r\n                      <div align=\"center\">1135</div></td>\r\n                  </tr>\r\n                              </table>\r\n              </div>              <p align=\"left\">The oil analysis was analysis out with oil samples taken after 0.5, 50, 100 ... 1250 hours engine<br>\r\n  running time. Viscosity at 40 and 100 0C, TBN, Insoluble\'s and wear metals were measured with<br>\r\n  Rimula TX I OW/30 + TOHO 9000 oil samples by AVL and Liebherr. Results with Rimula TX<br>\r\n  15W/40 oil samples without TOHO 9000 measured by Liebherr are also included in the figures.</p>\r\n              <p align=\"left\"><br>\r\n                  <b><a name=\"Viscosity\"></a>3.3.2. Viscosity, Insoluble\'s and Dispersant Efficiency</b><br>\r\n                  <br>\r\n  Adding TOHO 9000 to Rimula TX I 0W30 results in a viscosity increase to a SAE I 0W50 class and in a drop with a short running time of 50 hours to a SAE 1 0W40 class.</p>\r\n              <p align=\"left\">AVL&#146;s and LicbhcIT&#146;s results of viscosity at both temperatures (40 0C/fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B1.jpg\" target=\"_blank\">B1</a> and 100 0C/fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B2.jpg\" target=\"_blank\">B2</a>) show this significant decrease from zero to 50 hours running time and a very small further decrease up to Ca. 400 hours running time. From 400 hours running time, a slight viscosity increase in both temperatures appears, the lube oil class is still a SAE I 0W40 class. (Note: The engine oil consumption was compensated with a SAE 10W30 lube oil without TOHO. Nevertheless, the measured viscosity was a SAE I 0W40 oil.)</p>\r\n              <p align=\"left\">A completely contrary view is seen in the Liebherr results for the I 5W/40 lube oil without TOHO, where a relatively strong increase in viscosity is seen for the whole time period up to 500 hours running time.</p>\r\n              <p align=\"left\">However, a viscosity decrease during the first 50 hours running time can be explained either by an oil dilution with fuel or by the shearing of high molecular compounds to lower molecular ones, but we are not familiar if TOHO 9000 contains high molecular compounds. In order to demonstrate a possible oil dilution, the boiling point distribution of samples was measured by simulated distillation in gas chromatography. No oil dilution with the fuel was detected but a depletion of TOHO 9000 or some compounds of TOHO 9000 as demonstrated in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B3.jpg\" target=\"_blank\">B3</a>. On the other hand, a more or less stable viscosity increase with running time as seen with the standard Rimula TX15W/40 lube oil in figs. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B1.jpg\" target=\"_blank\">B1</a> and <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B2.jpg\" target=\"_blank\">B2</a> has never been observed at AVL to date. A viscosity increase in diesel engine oils is normally seen if the insoluble content of the oil amounts to 2% and more according to AVL&#146;s experience, and this can be confirmed by the insoluble slopes in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B4.jpg\" target=\"_blank\">B4</a>.</p>\r\n              <p align=\"left\">The Insoluble\'s were measured by infrared spectrometer (JR). By the way, the IR-spectra show a reduction of absorbence frequency at ca. 1740 cm&#146; wave number (&#151; 5.75 pm) caused by the topping up with lube oil without TOHO and/or by a degradation of compounds containing C = 0 groups. The measured peak minima are shown in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B5.jpg\" target=\"_blank\">B5</a>. The C = 0 degradation became larger and larger and was no longer measurable at running times of more than 500 hours. Carbonyl (C 0) compounds are used as dispersant additives in some lube oil formulations, but may also contribute to TOHO 9000. However, as shown by the drop tests (fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B6.jpg\" target=\"_blank\">B6</a>), the dispersant activity of the lube oil containing TOHO 9000 is still excellent after 1250 hrs. engine running time.</p>\r\n              <p align=\"left\"><b><a name=\"TBN\"></a>3.3.3. TBN</b><br>\r\n  The total base number (TBN) was measured according to ASTM-D-2896 - the perchloric acid procedure - by Liebherr and AVL as well as to ASTM-D-664 - the hydrochloric acid procedure -by AVL only. fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B7.jpg\" target=\"_blank\">B7</a>.</p>\r\n              <p align=\"left\">Normally, both methods yield the same TBN value for fresh oils, but show different diagrams<br>\r\n  over running time (which means increasing oil aging). While TBN values measured by ASTM-D-664 decrease over running time - due to neutralization of strong acids formed during combustion<br>\r\n  - an TBN increase measured by ASTM-D-2896 can sometimes be observed - an oxidation of<br>\r\n  wear metals occurs by perchloiic acid.</p>\r\n              <p align=\"left\">Fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B7.jpg\" target=\"_blank\">B7</a> shows the same TBN number of Rimula 1 5W/40 without TOHO (Licbherr ASTM-D-2896) and I 0W130 lube oil with TOHO (AVL ASTM-D-664). In case of the ASTM-D-2896 measurements of the I OW/30 lube oil with TOHO 9000. AVL and Licbhen found higher TBN numbers for the fresh oil compared to the ASTM-D-664 procedure. but both methods gave the same TBN number in fresh oils without TOHO 9000 when measured in the AVL lab.</p>\r\n              <p align=\"left\">However, the ASTM-D-664 procedure shows an unusually flat TBN depletion up to around 500 hours and a relatively stable slope with further running time, but in any case, the TBN degradation is unusually low (also see fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C13.jpg\" target=\"_blank\">C13</a>) and no problems even after 1250 hours endurance testing are indicated.</p>\r\n              <p align=\"left\"><br>\r\n                  <b><a name=\"Wear\"></a>3.3.4. Wear Metals</b><br>\r\n  Wear metals were measured by atomic emission spectrometer in ppm per sample. When topping up, the ppm value is lowered, but the real wear must more or less show a constant increase with running time for given driving conditions. Therefore, the wear is calculated in mg out of the measured ppm value as if no lube oil is consumed by the engine and no topping up has taken place.</p>\r\n              <p align=\"left\">After an initial increase, the ppm iron for example seems to be constant by around 80 ppm after ca 500 hours running time (fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/b8.jpg\" target=\"_blank\">B8</a>). Compared to this, the mg iron is approx. linearly increased with running time (fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/b9.jpg\" target=\"_blank\">B9</a>) and this means the real wear. The wear rates of iron up to 500 hours running time is comparable for all lube oils, therefore no advantage of TOHO 9000 was found. For copper, the ppm reading in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B10.jpg\" target=\"_blank\">B10</a> and the calculated mg in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/B11.jpg\" target=\"_blank\">B11</a> showed no linear increased in mg and this indicates a damage, in this case caused by an experimental bushing of the injection pump drive gear. The slopes of all other metals in mg vs. running time were found linear and do not indicate any problems (also see fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C11.jpg\" target=\"_blank\">C11</a>).</p>\r\n              <p align=\"left\"><br>\r\n                  <b><a name=\"VisualInspection\"></a>3.4. Visual Inspection of the Main Engine Components after the 1250 Hours Test with TOHO 9000</b></p>\r\n              <p align=\"left\">After the endurance test run, the engine was disassembled for a visual inspection of the main engine components. This work was done in close cooperation with the engine manufacturer to rely on his experience with engines of the same type running the same endurance test cycle.</p>\r\n              <p align=\"left\">Fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/E1.jpg\" target=\"_blank\">El</a> gives a summary of the assessment of the main engine components such as valves, intake and exhaust ports and manifolds and pistons in order to quantity~&#146; the visual impression of the buildup of carbon deposits.</p>\r\n              <p align=\"left\">The engine run after 1250 hours with TOHO is judged in the right column with a total of 8 points (minimum and thus best results possible is 7 points).</p>\r\n              <p align=\"left\">The visual condition of the main engine parts is illustrated in figs. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/E2.jpg\" target=\"_blank\">E2</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/E3.jpg\" target=\"_blank\">E3</a>,<a href=\"../Pics/Figures/E4.jpg\" target=\"_blank\">E4</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/E5.jpg\" target=\"_blank\">E5</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/E6.jpg\" target=\"_blank\">E6</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/E7.jpg\" target=\"_blank\">E7</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/E8.jpg\" target=\"_blank\">E8</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/E9.jpg\" target=\"_blank\">E9</a>, featuring photographs of the original assessment report of the engine manufacturer.</p>\r\n              <p align=\"left\">The visual inspection of the main engine pails can be summarized as follows:</p>\r\n              <div align=\"left\">\r\n                <table width=\"90%\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n                  <tr>\r\n                    <td width=\"18%\">Engine block:</td>\r\n                    <td width=\"82%\">clean, normal deposits</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Gear housing:</td>\r\n                    <td width=\"82%\">clean, normal deposits</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Cylinder liners:</td>\r\n                    <td width=\"82%\"><br>\r\n        good condition, no indication of bore polishing, honing pattern clearly visible</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Piston:</td>\r\n                    <td width=\"82%\">coked deposits on piston ring top land, first ring groove clean with minor deposits, good condition according to piston manufacturer</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Piston rings:</td>\r\n                    <td width=\"82%\">good condition, no excessive wear</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Con rod:</td>\r\n                    <td width=\"82%\">small and big end bearing, normal wear</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Crankshaft:</td>\r\n                    <td width=\"82%\">no visible wear on main journal and con rod journal</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Camshaft:</td>\r\n                    <td width=\"82%\">Normal wear relative to running time:<br>\r\n        wear after 1250 hours with TOHO: 0.201/0.261 mm wear after 500 hours w/o TOHO: 0.104/0.103 mm for intake and exhaust cam</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">\r\n                      <p></p>\r\n                      <p>Tappets:</p></td>\r\n                    <td width=\"82%\">no visible wear</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Rocker arms:</td>\r\n                    <td width=\"82%\">wear on contact area normal relative to running time:<br>\r\n        wear after 1250 hours with TOHO: 0.030/0.101 mm wear after 500 hours w/o TOHO: 0.042(?)/0.042 mm for intake and exhaust rocker arm</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">\r\n                      <p></p>\r\n                      <p>Valves:</p></td>\r\n                    <td width=\"82%\">carbon deposits on intake valve, no deposits on exhaust valve</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Oil pan:</td>\r\n                    <td width=\"82%\">rough layer on horizontal surfaces, clean vertical surfaces.</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Turbocharger:</td>\r\n                    <td width=\"82%\">layer on compressor housing inner surface</td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"18%\">Valve clearance:</td>\r\n                    <td width=\"82%\">0.35-0.45 for intake valve<br>\r\n        0.5 5-0.60 for exhaust valve after 1250 hours w/o readjustment</td>\r\n                  </tr>\r\n                              </table>\r\n              </div>              <p align=\"left\">It can be concluded that the visual condition of the engine after 1250 running hours with TOHO concerning visual wear and buildup of deposits is equal or better compared to the engine run without an oil change for 500 hours using standard Rimula TXI 5W40 lube oil w/o TOHO.</p>\r\n              <p align=\"left\">A comparable engine run over 500 hours with the recommended oil change after 250 hours has been judged to be only marginally better.</p>\r\n              <p align=\"left\"><br>\r\n                  <b><a name=\"FurtherEndurance\"></a>3.5. Further Endurance Test Results</b></p>\r\n              <p align=\"left\"><b>Full load performance and emissions versus running time</b></p>\r\n              <p align=\"left\">The engine full load performance and emission status of the engine was regularly checked during the 1250 hours of the endurance test run. Fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C1.jpg\" target=\"_blank\">C1</a> shows the comparison of the engine full load performance before the endurance test and after 1250 hours. A summary of the maximum power</p>\r\n              <p align=\"left\">of the engine versus the endurance test time is given in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C7.jpg\" target=\"_blank\">C7</a>. Figs. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C2.jpg\" target=\"_blank\">C2</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C3.jpg\" target=\"_blank\">C3</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C4.jpg\" target=\"_blank\">C4</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C5.jpg\" target=\"_blank\">C5</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C6.jpg\" target=\"_blank\">C6</a> compare the full load performance of the engine and Fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C8.jpg\" target=\"_blank\">C8</a> the emissions in the ECE R49 cycle in steps of 250 hours.</p>\r\n              <p align=\"left\">None of these results indicated any abnormal engine behavior.</p>\r\n              <p align=\"left\">As no statistically valid scatter band of results obtained on the same engine type running the same cycle and duration without using TOHO is available, the data cannot be correlated to the use of<br>\r\n  TOHO 9000.</p>\r\n              <p align=\"left\">Blowby versus running time</p>\r\n              <p align=\"left\">The engine blowby, the gas leaking mainly around the piston rings into the crank case is shown in figs. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C9.jpg\" target=\"_blank\">C9</a> and <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C10.jpg\" target=\"_blank\">C1O</a> for three different engine speeds at full load conditions.</p>\r\n              <p align=\"left\">After refilling the engine with the mixture of standard oil plus TOHO 9000, the blowby dropped by 5 to 8% within the first 6 running hours when compared to the results when using standard I 5W40 and I 0W30 lube oils.</p>\r\n              <p align=\"left\">These results indicate a positive effect of TOHO 9000 on the sealing capability of the piston ring - cylinder liner area.</p>\r\n              <p align=\"left\">Wear metals versus running time</p>\r\n              <p align=\"left\">Figs. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C11.jpg\" target=\"_blank\">C11</a> and <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C12.jpg\" target=\"_blank\">C12</a>.</p>\r\n              <p align=\"left\">The wear metals found in the lube oil show a similar trend for the endurance test engine using TOHO 9000 and the comparison engine run at LMB without TOHO as shown in fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C12.jpg\" target=\"_blank\">C12</a>. In this graph the LMB-analysis results by VERNOLAB/France are cross plotted</p>\r\n              <p align=\"left\">No indication for a change of the engine wear when using TOHO 9000 was found.</p>\r\n              <p align=\"left\">A very linear trend of the engine wear versus the test period indicates no problem on any main engine component.</p>\r\n              <p align=\"left\">The increase of copper after about 800 running hours is due to higher wear on one experimental part of the engine fuel injection pump drive and is thus not to be correlated with the use of TOHO (also see chapter 3.3.4).</p>\r\n              <p align=\"left\">Comparison of TBN</p>\r\n              <p align=\"left\">Fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C13.jpg\" target=\"_blank\">C13</a> shows the degradation of the total base number of the lube oil of the endurance test with TOHO in comparison with the usually experienced degradation of standard oils. Although this comparison is not scientifically correct because it is based on different engines (swept volume 3 to 12 liters) and test cycles (full load cycle, thermo shock cycle), the general trend of an unusually low degradation of TBN can be illustrated.</p>\r\n              <p align=\"left\">Oil consumption</p>\r\n              <p align=\"left\">The oil consumption of the engine was monitored during the whole test period and is presented in detail in figs. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C14.jpg\" target=\"_blank\">C14</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C15.jpg\" target=\"_blank\">C15</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C16.jpg\" target=\"_blank\">C16</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C17.jpg\" target=\"_blank\">C17</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C18.jpg\" target=\"_blank\">C18</a>.</p>\r\n              <p align=\"left\"><br>\r\n  Fig. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C17.jpg\" target=\"_blank\">C17</a> shows the trend of the rated power lube oil consumption in terms of (g/h) versus the endurance test running time.</p>\r\n              <p align=\"left\">A dramatically increased oil consumption was observed at approximately 600 hours whilst after<br>\r\n  750 hours the oil consumption improved continuously and at 1250 hours the level even nearly<br>\r\n  reached the initial values again.</p>\r\n              <p align=\"left\">The reason is unknown, moreover at the same time also the engine full load smoke and fuel consumption as well as the engine R49 emission results deteriorated simultaneously and improved again later on.</p>\r\n              <p align=\"left\">As shown in figs. <a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C14.jpg\" target=\"_blank\">C14</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C15.jpg\" target=\"_blank\">C15</a>,<a href=\"https://static-assets.site/bcms/templates/toho9000/Pics/Figures/C16.jpg\" target=\"_blank\">C16</a>, the natural lube oil consumption of the engine over the 1250 hours endurance test amounted to 63.5 liters, which is approximately 3 times the total oil filling volume of the engine 21.6L).</p>\r\n              <p align=\"left\">For fig. 18, showing the engine map lube oil consumption, it has to be mentioned that the measurement was, unfortunately, taken at the time of the highest lube oil consumption, but no other time window was available because of the tight schedule.</p>\r\n              <p align=\"left\">The map oil consumption was measured using AVL&#146;s oil consumption meter 403S.</p>\r\n              <p align=\"left\">In any way, the lube oil consumption results too cannot be correlated to the use of TOHO 9000 because no comparison data (statistical scatter band) of the same engine type operated without using TOHO along the same cycle and for the same running period is available.</p>\r\n              <p><br>\r\n              </p>  ', 'No');
INSERT INTO `mod_text` (`id`, `content_pagesID`, `content_text`, `sidebar_content`) VALUES
(3138, 364, '<h2 align=\"center\"> sender LIEBHERR MACHINES </h2>\r\n              <p></p>\r\n              <p align=\"left\">Subject: TOHO 9000 In LIEBHERR engines</p>\r\n              <p align=\"left\">Dear Mr. Barroso,</p>\r\n              <p align=\"left\">we enjoy the strong opposition from OEM when additive firms are going to do their trials at our engines - without giving warranty for our customers and us.</p>\r\n              <p align=\"left\">Normally the oil-industry is developing lube oil (base-oil and additive) to prove it in quality tests like CCMC, AGFA, API or special firm tests like MB 228.5, MAN 3277 and so on.</p>\r\n              <p align=\"left\">If you chance components or add components (oil or additive) you don&#146;t really know what reaction you get. For example the anti wear additives are not able to do their work, if you have increased the anti corrosive additives.</p>\r\n              <p align=\"left\">The AVL tests are really carried out on a LIEBHERR engine - with special elements as:<br>\r\n  bearings, gasket, cam followers and valves. We have results at following:</p>\r\n              <p align=\"left\">1. normal wear ratings</p>\r\n              <div align=\"left\">\r\n                <blockquote>&nbsp;\r\n                </blockquote>\r\n              </div>              <blockquote><p align=\"left\">abnormal reaction in viscosity<br>\r\n    first TOHO change viscosity rtlveau, second AVL has used<br>\r\n    SAE IOW-30 lube oil, not 15W-40 how we have provided</p>\r\n              </blockquote>\r\n              <p align=\"left\">3. engine cleanness was good</p>\r\n              <p align=\"left\"><br>\r\n  In any way, out of the results of only one endurance test on one engine a generally valid declaration ~s not permissible.</p>\r\n              <p align=\"left\">Extended field testing is recommended as a next step to assure long term stability and reliability criteria of the engine and the engine lube oil in real life.</p>\r\n              <p align=\"left\">with best regards<br>\r\n  LIEBHERR MACHINES BULLE S.A.<br>\r\n  8.: 1/1<br>\r\n  17/86/97 16:46<br>\r\n              </p>', 'No'),
(3139, 365, '<p align=\"left\">To : TOHO Marketing Company Ltd.</p>\r\n              <p align=\"left\">From : Institute fur Mineralolprodukte und Umweltanalytik</p>\r\n              <p align=\"left\">&nbsp;</p>\r\n              <p align=\"left\">Statement</p>\r\n              <p align=\"left\">You asked me in my capacity as A lube oil chemist to make a statement on the oil additive TOHO 9000 based upon the AVL report BV 0642 of December 1996. The title of the report was &quot;Endurance Test with TOHO 9000 Oil Additive on the Liebherr D926 TI-E Engine.&quot;</p>\r\n              <p align=\"left\">In this report the effect of the oil additive TO1IO 9000 on the aging behavior of engine lube oil was tested.</p>\r\n              <p align=\"left\">The standard oil Shell Rimula TX I 5W40 WaS used for a comparison test. It is a universal engine oil with a viscosity index of 138, in the data sheet the TBN-E is indicated as 10.0 mg KOH/g and the sulphate ash as 1.2 g/1OOg., i.e. a. the oil contains both ashen additives and ash free additives.</p>\r\n              <p align=\"left\">A mixture of 85% Shell Rimula TX 10W30 and 15% TOHO 9000 was tested. The viscosity class<br>\r\n  10W30 results from the fact that the oil containing the additive should have the same viscosity as the<br>\r\n  standard lube oil. By adding as much as 15% TOHO 9000 this product is an extender with additive<br>\r\n  properties.</p>\r\n              <p align=\"left\">After a endurance test of 1250 hours (MAN-Test) on a Liebherr D926 TI-% heavy-duty L-6 cylinder D.I. diesel engine the following results were observed:</p>\r\n              <p align=\"left\">The maximum power output, the fuel consumption and the smoke emission were equivalent within the measuring accuracy. The blowby of the engine (with TOHO 9000) dropped by 5-8%. Overall the same good level of engine-out emissions (measured according to the ECE R-49 Test) was observed for all measured emission components (NOx, HC, CO and particles).</p>\r\n              <p align=\"left\">The 1250-hour-test was performed without any oil change. The engine was filled with 85% standard lube oil and 15% TOHO 9000. The oil consumed was regularly topped up with standard lube oil where as the amount of oil taken out as sample every 50 hours was replaced with the mixture described above, i.e. standard lube oil plus 15% TOHO 9000.</p>\r\n              <p align=\"left\">The most essential result of the endurance test was the fact that no problems, even after 1250 hours running time, were indicated. The total base number (measured according to ASTM-D-664 or ASTM -D- 2896) is an indicator os still active additive. After 1250 hours running time the TBN of the lube oil containing TOHO 9000 showed an unusually low degradation, which, moreover, appeared during the first 50 hours and thereafter virtually remained constant. Adding TOHO 9000 to Rimula TX 10W30(SAE 10W30 + 15% TOHO 9000) resulted in an initial viscosity increase to a SAE 10W50 class and in a drop with a short running time of 50 hours to a SAE 10W40 class. Then then the viscosity was stable within the SAE 10W40 class up to 1250 hours running time. Mostly, the VI-improvers contained in engine oil are degraded by shearing, which results in a viscosity decrease. The dispersant activity of the lube oil containing TOHO 9000 was still excellent after 1250 hours engine running time. This is important because insoluble residues of combustion, e.g. soot,coke,resin and asphalt like oxidation products, have to be kept in suspension in order to prevent deposits on metal surfaces, oil thickening and sludge formation which, otherwise, can lead to corrosion. Wear metals showed a linear increase in mg metal, which indicates that TOHO 9000 does not influence engine wear.</p>\r\n              <p align=\"left\">In conclusion, the comparison test performed at AVL showed that the extender TOHO 9000 when used in a mixture of 85% standard lube oil and 15% TOHO 9000 in the engine described above maintains is excellent quality up to 1250 hours running time. Hence an extension of the running time to more that 1250 hours can be recommended (the natural oil consumption has to be topped up), whereas the normal cycle time of oil-changing for this test engine is 250 hours.</p>\r\n            <p align=\"left\">If the advantages of TOHO 9000 as an additive to engine lube oils, as stated in the AVL report, also prove true on a more general level, this additive will be able to extend the cycle time of oil-changing considerably and, thus, help reduce the amount of waste oil as well (environmental aspect).</p>', 'No'),
