(3150, 376, 'Welcome to Reseller Hosting<br>\r\nWe have a number of different packages for your future websites / servers. These packages are reseller accounts so you can on sell a slice of your server for a reasonable profit. You might be a programmer | designer | developer and need a safe and convenient place to host yours or your clients applications. You are basically buying server time at wholesale rates and the software reflects that your in charge and no one besides you ever sees who your upline is.<br>\r\n<br>\r\nWe have two different Control panels for sale, CPanel is the first and second is Direct Admin. CPanel is the most popular but Direct Admin does a pretty good job. You will be given the server log in details and you can sub let your control panel account to your clients. They can modify and customize all they want without the need for a professional. There is a bit of a learning curve so you may want to set the account up for them and the way it is organised you can compartmentalise different clients with different accounts, even if they hire someone different for their software development the account is completely functional so they wouldn\'t need to transfer servers. They wouldn\'t really be able to setup the same functionality for a cheaper price, we have rock bottom prices.', 'No'),
