(3200, 426, 'LSD, or lysergic acid diethylamide, is a powerful psychedelic drug that was first synthesized in 1938 by Swiss chemist Albert Hofmann. It is known for its mind-altering effects, including vivid hallucinations and altered perceptions of time and reality. While LSD has been the subject of controversy and legal restrictions, it has also been the focus of scientific research and therapeutic use.\r\n\r\nLSD is a Schedule I controlled substance in the United States, meaning it is considered to have a high potential for abuse and no currently accepted medical use. Possession, distribution, and use of LSD are illegal in many countries, including the US. Despite this, LSD has a long history of recreational use and was a prominent part of the counterculture movement of the 1960s.\r\n\r\nIn recent years, there has been a resurgence of interest in LSD as a potential therapeutic tool. Research has suggested that LSD may have therapeutic benefits for a range of conditions, including depression, anxiety, and addiction. However, much of this research is still in its early stages and more studies are needed to fully understand the potential benefits and risks of LSD as a therapy.\r\n\r\nOne of the major concerns with LSD use is the potential for adverse effects, both short-term and long-term. In the short term, LSD can cause a range of physical and psychological effects, including nausea, increased heart rate and blood pressure, and intense anxiety or paranoia. In some cases, LSD use can trigger a \"bad trip,\" which can be a terrifying experience and may result in long-lasting psychological effects.\r\n\r\nLong-term effects of LSD use are less well understood. There is some evidence to suggest that frequent LSD use may be associated with persistent changes in personality and cognition, including changes in mood, perception, and thought processes. However, these effects are not well understood and may be influenced by a range of factors, including individual differences in susceptibility and patterns of use.\r\n\r\nIn conclusion, LSD is a powerful psychedelic drug with a long and complex history. While it has been the subject of controversy and legal restrictions, it has also been the focus of scientific research and therapeutic use. While more research is needed to fully understand the potential benefits and risks of LSD, it is clear that the drug has the potential to cause both short-term and long-term adverse effects. Anyone considering using LSD should be aware of these risks and proceed with caution.', 'No'),
(3201, 427, 'Heroin, also known as diamorphine, is a highly addictive opioid drug that is derived from morphine. It is a powerful painkiller that is used medically in some countries, but it is mostly used illegally for its euphoric effects.\r\n\r\nHeroin is typically injected, smoked, or snorted. Its effects include a rush of euphoria, followed by a state of relaxation and sedation. Over time, heroin use can lead to addiction, as well as a range of negative physical and mental health effects.\r\n\r\nWhile some people may argue that heroin use can be recreational and harmless, the reality is that it is a dangerous drug that can have serious consequences. Heroin use can lead to overdose, which can result in respiratory failure and death.\r\n\r\nFurthermore, heroin use can also lead to a range of other health problems, including infections, abscesses, and damage to the liver and kidneys. Additionally, heroin addiction can have a devastating impact on an individual\'s life, leading to financial problems, relationship issues, and a range of mental health problems.\r\n\r\nIt is important to note that the use of heroin is illegal in most countries, and possession or distribution of the drug can result in criminal charges. While some people may argue that drug laws should be changed to allow for the legal use of heroin, the risks associated with the drug make this a difficult argument to make.\r\n\r\nIn conclusion, while heroin may offer temporary feelings of euphoria and relaxation, the long-term consequences of the drug make it a dangerous and addictive substance. It is important for individuals to understand the risks associated with heroin use and to seek help if they or someone they know is struggling with addiction.', 'No'),
(3202, 428, 'esponse to this crisis, the FDA has taken a number of steps to restrict access to the drug and promote safer use practices.\r\n\r\nOne of the main criticisms of OxyContin is that it was aggressively marketed by its manufacturer, Purdue Pharma, as a safe and effective painkiller with a low risk of addiction. The company used a range of marketing tactics to promote the drug, including giving doctors free samples, sponsoring medical conferences and education programs, and paying physicians to speak at events. Purdue also reportedly downplayed the risks of addiction and withdrawal associated with the drug, and misrepresented the results of clinical trials.\r\n\r\nAs a result of these marketing practices, many doctors and patients came to view OxyContin as a first-line treatment for chronic pain, despite the lack of evidence to support this use. This fueled the over-prescription of the drug and contributed to the rise of the opioid epidemic in the U.S.\r\n\r\nIn recent years, Purdue Pharma has faced a wave of lawsuits and legal challenges related to its marketing of OxyContin. In 2019, the company filed for bankruptcy as part of a proposed settlement agreement with multiple states and local governments. The settlement would require Purdue to pay billions of dollars to help address the opioid epidemic and would also require the company to be restructured and operated in a new, public-benefit model.\r\n\r\nOverall, while OxyContin can be an effective pain reliever when used appropriately, its misuse and abuse have had devastating consequences for individuals, families, and communities across the U.S. The aggressive marketing tactics used by Purdue Pharma to promote the drug have been widely criticized, and have contributed to the opioid epidemic. It is important for doctors and patients to be aware of the risks associated with OxyContin and to use it only when necessary and under close supervision.', 'No'),
(3203, 429, 'Morphine is a powerful opioid medication used to treat moderate to severe pain. It was first isolated from opium in the early 19th century by a German chemist named Friedrich SertÃ¼rner.\r\n\r\nMorphine works by binding to specific receptors in the brain and spinal cord, which reduces the perception of pain. It is commonly used in hospitals to treat pain associated with surgery, injury, or chronic conditions such as cancer. It is also used for palliative care, to alleviate pain in patients who are terminally ill.\r\n\r\nDespite its effectiveness in pain relief, morphine has a high potential for abuse and dependence. It can cause feelings of euphoria, sedation, and relaxation, which can be addictive for some individuals. Over time, regular use of morphine can lead to tolerance, meaning that higher doses are needed to achieve the same level of pain relief. It can also cause physical dependence, which can result in withdrawal symptoms if the medication is stopped abruptly.\r\n\r\nBecause of its potential for abuse and dependence, morphine is classified as a Schedule II controlled substance in the United States, which means that it is tightly regulated and can only be prescribed by a licensed healthcare provider.\r\n\r\nDespite its risks, morphine remains an important medication in the treatment of pain, particularly for patients with chronic or terminal illnesses. It is often used in conjunction with other pain management strategies, such as physical therapy or non-opioid medications.\r\n\r\nAs with any medication, it is important to use morphine as directed by a healthcare provider and to report any side effects or concerns to them. It should not be used by individuals who have a history of substance abuse or addiction, or by pregnant women unless specifically directed by a healthcare provider.\r\n\r\nOverall, morphine is a powerful pain medication with both benefits and risks. It is an important tool in the treatment of pain, but it must be used carefully and with appropriate oversight to minimize the risk of abuse, dependence, and other negative outcomes.', 'No'),
(3204, 430, 'Viagra, also known by its generic name sildenafil, is a medication used to treat erectile dysfunction (ED) in men. It works by increasing blood flow to the penis, which can help men achieve and maintain an erection.\r\n\r\nViagra was first approved by the US Food and Drug Administration (FDA) in 1998, and since then, it has become one of the most well-known and widely prescribed medications for ED. However, despite its popularity, Viagra has also been the subject of controversy and debate.\r\n\r\nOne of the main concerns with Viagra is the potential for misuse and abuse. Some men may take the medication recreationally, without a prescription or medical need, which can lead to serious health consequences. Additionally, there have been reports of Viagra being sold online or on the black market, often at a higher dosage than recommended, which can also pose a risk to users.\r\n\r\nAnother concern is the potential for side effects. Common side effects of Viagra include headache, facial flushing, and upset stomach, but more serious side effects can occur in rare cases. For example, some men may experience sudden vision or hearing loss, which can be a sign of a more serious underlying condition.\r\n\r\nDespite these concerns, Viagra has been shown to be an effective and safe treatment for ED when used as directed and under the supervision of a healthcare provider. In fact, studies have found that Viagra can improve not only the physical symptoms of ED but also the psychological and emotional impact of the condition.\r\n\r\nOverall, Viagra is a medication that can provide significant benefits for men with ED, but it should only be used as directed and under the guidance of a healthcare provider. Like any medication, it carries potential risks and side effects, and it is important to weigh the potential benefits and risks before deciding to use it.', 'No'),
(3205, 431, 'Valium, also known by its generic name diazepam, is a medication that belongs to the class of drugs known as benzodiazepines. It is primarily used to treat anxiety disorders, muscle spasms, and seizures.\r\n\r\nValium works by enhancing the effects of a neurotransmitter called gamma-aminobutyric acid (GABA), which helps to calm the central nervous system. This leads to a reduction in anxiety, muscle tension, and seizures.\r\n\r\nLike all medications, Valium has both potential benefits and potential risks. One of the main benefits of Valium is its ability to provide short-term relief for people experiencing symptoms of anxiety or muscle spasms. It can also be helpful in preventing or treating seizures.\r\n\r\nHowever, Valium can also cause a range of side effects, including drowsiness, dizziness, confusion, and impaired coordination. In some cases, it can also cause more serious side effects, such as respiratory depression, especially when combined with other medications or alcohol.\r\n\r\nValium can also be habit-forming, and people who take it for long periods of time or at high doses may develop a physical dependence on the drug. Withdrawal from Valium can be difficult and may lead to a range of symptoms, including anxiety, insomnia, and seizures.\r\n\r\nIt is important to note that Valium should only be used under the guidance of a healthcare professional and as prescribed. People who take Valium should not drive or operate heavy machinery, as the drug can impair their ability to do so safely.\r\n\r\nIn summary, Valium is a medication that can be helpful in treating anxiety disorders, muscle spasms, and seizures. However, it should only be used as prescribed and under the guidance of a healthcare professional. Like all medications, Valium can cause side effects and has the potential for misuse or addiction.', 'No'),
(3206, 432, 'DMT, or dimethyltryptamine, is a powerful psychedelic compound that has gained popularity in recent years due to its intense and often mystical effects. Despite its growing reputation, however, there is still much that is not known about this substance.\r\n\r\nDMT is naturally occurring and can be found in several plant species, including ayahuasca, which has been used in traditional Amazonian shamanic practices for centuries. It is also found in small amounts in the human body and is believed to be involved in certain mystical experiences.\r\n\r\nOne of the unique aspects of DMT is its short duration of action. When smoked or injected, the effects of DMT can begin within seconds and usually last for only a few minutes. During this time, users often report profound changes in perception and a sense of encountering otherworldly beings or entities.\r\n\r\nDespite its reputation as a powerful hallucinogen, DMT has a relatively low risk of physical harm. There have been no known cases of overdose or long-term physical damage resulting from the use of DMT. However, like any psychoactive substance, DMT can be psychologically intense and may pose risks for individuals with certain mental health conditions or who are prone to panic or anxiety.\r\n\r\nThe legal status of DMT varies by country, with many nations classifying it as a Schedule I controlled substance. In the United States, for example, possession and use of DMT is illegal under federal law, although some religious groups are permitted to use ayahuasca as part of their religious practices.\r\n\r\nResearch into the effects and potential therapeutic uses of DMT is still in its early stages, and much remains to be discovered. Some researchers have suggested that DMT may have potential as a treatment for depression, anxiety, and addiction, but further studies are needed to confirm these possibilities.\r\n\r\nOverall, DMT is a powerful and mysterious substance that has captured the attention of many people in recent years. While much remains to be learned about its effects and potential uses, it is clear that DMT has the potential to offer profound and transformative experiences to those who use it. As with any substance, however, it is important to approach DMT with caution and respect, and to understand the potential risks and benefits before deciding to use it.', 'No'),
(3207, 433, 'Ketamine, also known as \"Special K\" or simply \"K,\" is a powerful dissociative anesthetic that has been used in both human and veterinary medicine since the 1960s. It is a Schedule III controlled substance in the United States, meaning that it has a moderate to low potential for abuse and dependence compared to Schedule I and II drugs.\r\n\r\nIn recent years, ketamine has gained attention as a potential treatment for depression, particularly in individuals who have not responded to traditional antidepressants. This is because ketamine has been shown to have rapid-acting antidepressant effects, with some studies reporting an improvement in symptoms within hours of administration.\r\n\r\nHowever, the use of ketamine for depression is still controversial and not yet approved by the US Food and Drug Administration (FDA) for this purpose. While some doctors have begun to use ketamine off-label for treatment-resistant depression, others have expressed concern about the lack of long-term safety and efficacy data.\r\n\r\nKetamine is also known for its potential for abuse and addiction. It is a commonly used recreational drug, often in the form of a white powder that is snorted, injected, or smoked. In addition to its dissociative effects, ketamine can also cause hallucinations and a sense of detachment from one\'s body and surroundings.\r\n\r\nRepeated use of ketamine can lead to a variety of negative health consequences, including memory impairment, difficulty concentrating, and bladder problems. It can also lead to psychological dependence and withdrawal symptoms, such as anxiety and insomnia.\r\n\r\nIn conclusion, while ketamine has shown promise as a potential treatment for depression, its use should be approached with caution due to its potential for abuse and long-term health consequences. Further research is needed to fully understand its safety and efficacy as a psychiatric medication. Anyone considering the use of ketamine should consult with a qualified healthcare professional to discuss the potential benefits and risks.', 'No'),
(3208, 434, 'Magic mushrooms, also known as psilocybin mushrooms, are a type of fungi that contain the psychoactive compound psilocybin. Psilocybin mushrooms have been used for centuries in traditional medicine and religious ceremonies in various parts of the world. In recent years, they have gained popularity as a recreational drug due to their mind-altering effects.\r\n\r\nResearch on the therapeutic potential of magic mushrooms is still in its early stages, but preliminary studies suggest that psilocybin may be effective in treating a range of mental health conditions, including depression, anxiety, and addiction. Some studies have also shown that psilocybin can increase feelings of openness, empathy, and spirituality.\r\n\r\nHowever, it is important to note that psilocybin is a Schedule I controlled substance in the United States, meaning that it is illegal to possess, distribute, or use. The use of psilocybin mushrooms can also have adverse effects, including paranoia, hallucinations, and anxiety.\r\n\r\nDespite their potential therapeutic benefits, it is important to approach magic mushrooms with caution and only use them under the guidance of a trained professional. It is also important to ensure that any mushrooms consumed are from a trusted source and are not contaminated with other substances.\r\n\r\nOverall, while the therapeutic potential of magic mushrooms is promising, more research is needed to fully understand their effects and potential risks. As with any substance, it is important to approach them with caution and make informed decisions about their use.', 'No'),
(3209, 435, '<a href=\"/what-is-meth-amphetamine/\">What is Crystal Meth</a><br>\r\n<a href=\"/what-are-magic-mushrooms/\">What are Magic Mushrooms</a><br>\r\n<a href=\"/what-is-ketamine/\">What is Ketamine</a><br>\r\n<a href=\"/what-is-dmt/\">What is DMT</a><br>\r\n<a href=\"/what-is-valium/\">What is Valium</a><br>\r\n<a href=\"/what-is-viagra/\">What is Viagra</a><br>\r\n<a href=\"/what-is-morphine/\">What is Morphine</a><br>\r\n<a href=\"/what-is-oxycontin/\">What is Oxycontin</a><br>\r\n<a href=\"/what-is-heroine/\">What is Heroine</a><br>\r\n<a href=\"/what-is-lsd/\">What is LSD</a><br>\r\n<a href=\"/what-is-cocaine/\">What is Cocaine</a><br>\r\n<a href=\"/what-is-mdma/	\">What is MDMA / Molly</a><br>\r\n<a href=\"/what-is-cannibis/\">What is Cannibis</a><br>\r\n\r\n', 'No'),
(3210, 436, '<div class=\"leftpictureholder\">\r\n<img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/DancingBudha.jpg\" width=\"241\"/><br/>\r\n                <br/>\r\n                <br/>\r\n                <img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/250px-Sun_Wukong_and_Jade_Rabbit.jpg\" width=\"241\" /><br/>\r\n                <br/>\r\n                <br/>\r\n                <img src=\"https://static-assets.site/bcms/templates/darisjin/images/handstand.jpg\" width=\"241\"/>\r\n  </div>\r\n<div class=\"rightcontentholder\">\r\n\r\n                    <br/>\r\n                    IMPORTANT MESSAGE\r\n                <br/>\r\n                <br/>\r\n                <br/>\r\n                Â <br/>\r\n                <br/>\r\n                The book â€œThe Formless Disciplineâ€ acts as a key to unlocking the \r\n                secrets of kung fu. The book is the basic centre circle of essential \r\n                training derived for understanding of dynamic systems applied to the \r\n                body. These techniques have a nomadic origin and are simple in \r\n                method yet also challenging to master. The further you go into the \r\n                teachings the more you realise just what mastery of the body is and how \r\n                sophisticated and intricate energy arts actually are. <br/>\r\n                Â The teaching method is both challenging and rewarding.<br/>\r\n                <br/>\r\n                The bridge between student and master doesn\'t really exist. It \r\n                is something which has developed over time as history changed \r\n                and mankind developed. In an ancient civilianisation to learn such \r\n                things may have been second nature, because of the life-styles people \r\n                had. People were fitter and much less distracted. These days it can \r\n                often take time to clear an individual of distraction or develop the \r\n                minimal health and fitness requirements. Humans were also more attune to nature making it easier for them to develop themselves \r\n                on such a simplistic level. <br/>\r\n                <br/>\r\n                Â This training has no ideological \r\n                preconceptions. The true purpose of the training is to tap right into \r\n                the core of the mind and body. By developing this physical and mental \r\n                link one can attain a type of \r\n                skill.Â Â  <br/>\r\n                <br/>\r\n                <br/>\r\n                <br/>\r\n                <br/>\r\n                <div class=\"style1\"><em>Meaning of Kung Fu </em></div>\r\n                <br/>\r\n                Then you think about it, kung fu has to come from somewhere, ordinary \r\n                instincts to fight are there, however exercises to enhance this ability \r\n                had to be developed. <br/>\r\n                <br/>\r\n                The forms handed down in martial arts. They are a collaboration of \r\n                dynamic postures, a series of frames for a manuscript describing the \r\n                relationship between energy and the body. Traditional kung fu was actually \r\n                derived from a more ancient source, an expression of energy as a living entity, an understanding along those lines.<br/>\r\n                <br/>\r\n                <br/>\r\n                According to legend, the great leader of china â€œthe yellow emperor,\" \r\n                developed kung fu 3000 years ago for exercises said to be for healing the \r\n                body. He (Huang Di) is said to be in link with an ancient civilization, \r\n                his powers the result of a communing with the ancients of that world. \r\n                Now this is just a story. What if the element of truth here is that an \r\n                ancient art exists which is type of precursor? It\'s conception being timeless \r\n                it would become a unique type of discipline.Â  <br/>\r\n                <br/>\r\n                This means that kung fu, in its timeless sense being essential to \r\n                mastery of the human body, is related to enlightenment. It has in fact \r\n                existed over many lands for many thousands of years. Alongside \r\n                corruption and secrecy, \r\n                the truth becomes surrounded by superstition, rigidity and things \r\n                that would contradict the art.<br/>\r\n                <br/>\r\n                Â There are things that you can be absolutely sure of, one of them is \r\n                that history is not exactly as has been written. Inspired by the efforts \r\n                ofÂ  greatness in the world, they all suggest the same, there are always \r\n                things beyond  \r\n                institutions, an established ego or identity, it is perhaps the search \r\n                for a human \r\n                beings true identity. This is why the art \r\n                requires serenity and enlightenment. Practise encourages a state of awareness it is achieved \r\n                out of efforts of conception and introspection, consolidation of the \r\n                will, focus and rhythm. <br/>\r\n  </div>\r\n<div style=\"clear:both;\"></div>', 'No'),
(3211, 437, '<div class=\"leftpictureholder\">\r\n<img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/DichCanKinh-Yi_Jin_Jing.jpg\" width=\"241\" height=\"171\"/><br/>\r\n</div>\r\n<div class=\"rightcontentholder\">\r\n\r\n                    Â <br/>\r\n                <span class=\"pagetitle\">History</span><br/>\r\n                Â <div class=\"style1\" style=\"height: 15px\">\r\n                    Finding True Kung Fu</div>\r\n                <br/>\r\n                <br/>\r\n                <br/>\r\n                To be more technically specific about methods in martial arts, one must \r\n                delve into the dualism of the techniques. Kung fu uses numbers, the \r\n                numbers describe concepts, concepts promote development. Further the \r\n                concepts and you will further the refinement. Their basis is, dynamics, \r\n                rhythms, contours, vectors, \r\n                foot steps, variability, etc.  \r\n                <br/>\r\n        Â  \"Shaolin\" kung fu is now famous around the world, and has a \r\n                range of diversity. Northern and \r\n                southern temple training includes \r\n                many styles and teachings, it is considered a unique stylised \r\n                family of systems. The creation of a kung fu style is essentially the \r\n                result of an individuals practise.Â  <br/>\r\n        Â The technical application of kung fu in combat, is sometimes referred to \r\n                as shadow boxing. Actual shadow boxing flows in constant sequence and has no rigid \r\n                basis. The forms in \"Shaolin\" were derived from the \r\n                sequences ofÂ  techniques using combat strategies. The famous styles \r\n                of â€œwu tangâ€ are also derived and adapted as a result of these techniques \r\n                being of fundamental importance. When combined in such a way that a \r\n                practiced form becomes a continuous routine, \r\n                a â€œkataâ€ results. Strictly speaking they would have been memorized as \r\n                short sets of combinations, then the forms could be further refined and \r\n                extended. Every dynamic movement is therefore capable of being applied \r\n                through combat, this develops a type of skilful grappling, \"sticky \r\n                hands\". <br/>\r\n                <br/>\r\n                Â The true essential methods of \"lohan\" kung fu are best taught and developed in isolation. \r\n                This is because developing the mind and body link, is arduous and \r\n                somewhat tedious. An involved process taking years to properly mature. \r\n                \"Lohan\"Â  as one could say, is the result of a person training in a \r\n                deep state with the energy for a long period of time. This leads to \r\n                formlessness, it is the true kung fu, the \"arhat\" fighting method. This fighting is no longer fighting then, it becomes another discipline \r\n                altogether. It has no style and no form, yet it resembles the many \r\n                forms of kung fu that have existed simply because it is their \r\n                origin.<br/>\r\n                <br/>\r\n                <br/>\r\n  </div>\r\n<div style=\"clear:both;\"></div>', 'No'),
(3212, 438, '<div class=\"leftpictureholder\">\r\n\r\n<img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/monkey%20king.jpg\" width=\"241\" height=\"301\"/><br/>\r\n		<br/>\r\n		<br/>\r\n		<br/>\r\n</div>\r\n<div class=\"rightcontentholder\">\r\n\r\n                    Â &nbsp;<br/>\r\n                <span class=\"pagetitle\">Development</span><br/>\r\n		<br/>\r\n		<div class=\"style1\">\r\n			&nbsp;Original Kung Fu</div>\r\n		<br/>\r\n		<br/>\r\n		<br/>\r\n		The original idea actually, was to develop a non-specific basic training \r\n		routine which encompassed theory from holistic medicine. This could \r\n		be adapted to suit any type of practitioner, because it would develop \r\n		the foundation for most energy related esoteric arts, not just fighting \r\n		but healing techniques as well.&nbsp; <br/>\r\n		<br/>\r\n&nbsp;In a matter of speaking energy if predefined has a kind of \r\n		path or way about it, this is just a method of leaning about that path. \r\n		So it&#39;s not really &quot;anything particular&quot; in the end. It may resemble \r\n		previous \r\n		training because there are really only so many positions the body can \r\n		make, this depends on the level of refinement. It is more readily \r\n		adapted to mastery of \r\n		combat effectiveness in adopting strategy from the bodies \r\n		perspective. This has something to do with human nature, or a human \r\n		beings nature on this earth.&nbsp; <br/>\r\n&nbsp;<br/>\r\n		&nbsp;The best part of people \r\n		is that they all share an interest in uncovering our deeper human truth. \r\n		Even if it means escaping.&nbsp;&nbsp; <br/>\r\n		<br/>\r\n		<br/>\r\n  </div>\r\n<div style=\"clear:both;\"></div>', 'No'),
(3213, 439, '<div class=\"leftpictureholder\">\r\n<img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/dragon.jpg\" width=\"241\" height=\"163\"/><br/>\r\n		<br/>\r\n		<img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/swordandbuddha.jpg\" width=\"241\" height=\"160\"/><br/>\r\n		<br/>\r\n		<img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/snake%20crane%20drawing.jpg\" width=\"241\" height=\"267\"/>\r\n\r\n</div>\r\n<div class=\"rightcontentholder\">\r\n\r\n                    Â &nbsp;<br/>\r\n                <span class=\"pagetitle\">Formlessness</span><br/>\r\n		<br/>\r\n		<div class=\"style1\">\r\n			The Discipline Applied</div>\r\n		<br/>\r\n		The difficult part is placing the cycles at different levels then \r\n		allowing for them to move between each other. The hand cycles correspond \r\n		to foot steps and then you can develop sequences. Then the sequences \r\n		correspond to movements in the forms.&nbsp; When you do a form using the \r\n		&quot;formless&quot; method it looks different because youâ€™re not going to be \r\n		copying any particular routine from a teacher, you&#39;ll produce it from \r\n		scratch and blend various sequences. It&#39;s a type of internal training, \r\n		the energy flow is better when \r\n		using the formless method, and this is why it is developed slowly. The fast techniques demonstrated sometimes \r\n		are not actual fundamental training, just the result of focused \r\n		channelling and energy manipulation. Most of the training involves slow \r\n		cyclical development and correspondence. One must be patient and wait, \r\n		while youâ€™re training slowly the energy level will just pick up with the \r\n		circulation and start channelling through you automatically. Trying to force speed, power or \r\n		energy elevation is taxing to the mind and body.<br/>\r\n		<br/>\r\n		Itâ€™s sophisticated a bit like something out of a medical journal. This \r\n		world would be quaint if such physical interpretations were uniform and \r\n		standard. Not meaning to confuse, thinking this way is \r\n		different from convention at the moment. Consider the depth of purpose dealing so greatly with the \r\n		human entity more specifically technology and enlightenment. Academics \r\n		as a whole are still largely behind as a \r\n		result of the conflicts arising from learning as an institution. One \r\n		problem is that, naive dialectic philosophy runs rampant throughout the \r\n		world and this over-simplifies things. Intellectuals, who pride \r\n		themselves on heightened perception, cannot fully reach a level in their \r\n		minds that allows them to properly conceptualise heightened instinct or \r\n		an enlightened being.&nbsp; <br/>\r\n		<br/>\r\n		<div class=\"style1\" style=\"height: 15px\">\r\n		Kung Fu</div>\r\n		<br/>\r\n		.....Kung fu is one thing, it is a timeless conception of the universe, \r\n		and it is unique to the human. It&#39;s so simple it can be taught to a \r\n		child, so sophisticated it will endlessly define an individualâ€™s life. \r\n		True kung fu is earned through enlightenment. This is to some a profound \r\n		change for a human being to make. In reality the minds development is as \r\n		subtle and graduated as the energies gathering and surrounding the body. \r\n		It takes time. There is no trick. The secrets exist to deal with the \r\n		logic of the human body and its relationship to the environment. One must expand on space and slow time to uncover the inner \r\n		workings of the body, this is the basis of internalisation, in this way \r\n		the mind-body link develops, and it is the heightened awareness of this \r\n		link that allows the sage to exist. The patterns of energy in the body \r\n		are then universally predefined they are preconditioned as nature. \r\n		Energy like all things can not follow a ridged path and so a paradox \r\n		must exist for what is predefined cannot be defined. One thing that kung fu represents, \r\n		is an evolution of our being. \r\n		The discipline of formlessness is a way to be one with energy. Energy \r\n		that is a formless entity which has many expressions, that resides \r\n		amidst the individual through a reflective intelligence which may seem \r\n		separate from ones own conscious thought yet allows the whole process to \r\n		be sparked and guided, this only comes from real kung fu , real self \r\n		mastery....<br/>\r\n		<br/>\r\n		<br/>\r\n  </div>\r\n<div style=\"clear:both;\"></div>', 'No'),
(3214, 440, '<div class=\"leftpictureholder\">\r\n<img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/DSC00970.jpg\" width=\"241\" height=\"199\"/><br/>\r\n		<br/>\r\n		<img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/RidingTheDragon.jpg\" width=\"241\" height=\"288\"/><br/>\r\n		<br/>\r\n		<img alt=\"\" src=\"https://static-assets.site/bcms/templates/darisjin/images/images.jpg\" width=\"241\" height=\"375\"/><br/>\r\n		<br/>\r\n		<br/>\r\n		<br/>\r\n</div>\r\n<div class=\"rightcontentholder\">\r\n\r\n                    Â &nbsp;<br/>\r\n                <div class=\"style1\">\r\n                    &nbsp; Spirituality</div>\r\n                <br/>\r\n                This is a path to insight. To have developed such insight can one be \r\n                more helpful? Becoming invariably one with energy, is for what reason?<br/>\r\n                <br/>\r\n                Unfortunately modern civilisations lie about their history, this is \r\n                where the problems are surfacing. <br/>\r\n                <br/>\r\n                I was fortunate enough to meet people who could steer me in the \r\n                necessary direction. Even when people cooperate, it gets difficult to get true clarity on whatâ€™s \r\n                happening. In order to solve and rediscover one must make \r\n                sacrifices. <br/>\r\n                <br/>\r\n                I was originally disappointed by some academics. The institutions and hierarchies \r\n                seemed to be missing something. <br/>\r\n                <br/>\r\n                The relationships between the \r\n                universe, the environment and the body. The basic principles \r\n                behind natural body movement, how these movements are isolated as \r\n                channels, and how channel&#39;s can form and interact as a result of \r\n                variable universal motion. A timeless method. The precursor of esoteric practice. <br/>\r\n                <br/>\r\n                &nbsp;Initially I \r\n                could see there were problems with secrecy in holistic disciplines, and It \r\n                was difficult to work it all out at the time. I questioned in my \r\n                mind everyday. A lot of what is done, is to keep you in line, to make \r\n                you work hard, to see that you remain obedient to those above you. Where \r\n                were we all meant to draw the line on success or failure, progress or \r\n                lacking? If someone&#39;s bucket is more than half full, they can still be \r\n                missing something. If someone is less than half <br/>\r\n                full do they become more accomplished by accepting that with humility?<br/>\r\n                <br/>\r\n                A clear map of energy can exist in ones mind, the sensations permanent \r\n                in flesh. There is still much that one can learn, only \r\n                now you can learn differently, you don&#39;t become what you set out to be, \r\n                but \r\n                wilfully become something else. <br/>\r\n                <br/>\r\n        &nbsp;To be staring at the \r\n                source, to be in link with a profound truth without any organised \r\n                motive. There is no end to it, the insight takes time and \r\n                seems to come in bouts, one can apply particular logic, and spark tremendous feats. \r\n                There are a multitude of levels of application. Insight to \r\n                mastery of forces and nature, healing and spirit will actually come by \r\n                itself. \r\n                Meditation and fighting will promote emotional endurance, this is a big \r\n                part in how the minds mastery of the body must begin.\r\n                <br/>\r\n                It does come down to a sophistication of very simple perceivable forces, like all things, it is always very simple at depth then becomes \r\n                intricate and beautiful.<br/>\r\n                <br/>\r\n                At one stage, you just couldn&#39;t trust anyone, because there were just too \r\n                many mix ups everywhere, even in oneself.&nbsp; These are the result of ideals \r\n                bombarded by all through life, the world is \r\n                full of them, modern day warfare, politics and laws, finance, \r\n                relationships, the list goes on. There are people who are made to feel \r\n                anguish, that they cannot belong, conceptualizations which are not actual \r\n                logic but propaganda. It all had to be filtered. <br/>\r\n                At times you wondered if you just got taken for a massive con, and \r\n                everyone knows everything and your just a mental weirdo because you \r\n                didn&#39;t realize it sooner. <br/>\r\n                <br/>\r\n                The way is simple, it describes elaborate relationships. It is a universal algorithm using a non-algebraic \r\n                format. Patterns then have relationships which can be adapted at \r\n                different levels. <br/>\r\n        &nbsp;They are dialectics, yin-yang becomes a method of describing an \r\n                actual objective dynamic perceived in space and time, it&#39;s parameters attributed to numbers. The real relationship \r\n                actually is to do with a breakdown \r\n                of dynamic systems. The use of correspondence may come about to describe \r\n                particularities through symbolism. This is what gets open to \r\n                misinterpretation, ambiguity. To understand the esoteric arts properly \r\n                you really need to have a definite understanding, what is actually \r\n                there, what you are manipulating, that is the art.\r\n                <br/>\r\n                <br/>\r\n  </div>\r\n<div style=\"clear:both;\"></div>', 'No'),
