(1, 'Creative Web Logic', '15 parkview crs', '', '', 'yamba', '', 'Queensland', 2464, 0, 'web-design-development', '0266469941', '0400923532', '000', 'info@creativeweblogic.net', 'www.creativeweblogic.net', 'daniel ruul', 'OUBoUa', '', 1, 0, 'xxx', 'Yamba, Maclean Web Design and Development. Creative web logic has worked on projects big and small, we strive towards excellence and engage professionalism in all regards. We have recently moved to Yamba NSW for a bit of a sea change and now is working on a few local projects including this directory.                                    ', 3737, 'Approved', 0, 0),
(2, 'Angourie Waves Apartments ', '17 Bay Street', '', '', 'yamba', '', 'Queensland', 2464, 0, 'angourie-waves-apartments', '02 66 462 321', '02 66 462 321', '02 66 462 321', 'rentals@eldersyamba.com.au', 'www.angouriewaves.com.au', 'admin', '6oZyX4', '', 1, 0, 'xxx', 'Angourie is a quiet village overlooking world class surfing beaches and surrounded by magnificent Yuraygir National Park. Nearby is the beachside fishing port of Yamba. Let Angourie Waves be your ideal escape destination.                ', 933, 'New', 0, 0),
(3, 'Angourie Rainforest Resort', '166 Angourie Rd ', '', '', 'yamba', '', 'Queensland', 2464, 0, 'angourie-rainforest-resort', '61 2 6646 8600', '61 2 6646 8600', '61 2 6646 8611', 'enquiry@angourieresort.com.au', 'www.angourieresort.com.au', 'admin', 'iLZyfh', '', 1, 0, 'xxx', 'Angourie Rainforest is a beautiful Resort in paradise that lies between sandy shores and treasured national parks on the Yamba peninsula. With 2 bedroom villas and 1 bedroom suites set against a rainforest backdrop, the award winning Resort offers entertainment for everyone. Enjoy swimming pools, an activities room, indoor and outdoor kids playground areas,  free Eco Kids, ClubBar, Restaurant,  Day Spa, Tennis Court and much much more.                 ', 933, 'New', 0, 0),
(4, 'Digital Blitz', 'home office', '', '', 'surfers paradise', '', 'Queensland', 4217, 0, 'digitalblitz', '07 5538 7722', '0405451873', '0', 'sales@digitalblitz.com.au', 'digitalblitz.com.au', 'simon', 's1Rytc', '', 1, 0, '33', 'Digital blitz understands the needs of business. We have developed a solution to manage multiple websites, content and hosting. A stable system that included content creation and customised design. Create new and manage multiple websites. Suports multiple languages and google analytics is installed for reporting and tracking. Superior customer services and support make us the ultimate website development organisation on the gold coast and possibliy Australia. Full agency support includes copy writers, graphic artisits and programmers. Project managed services drive projects to complete on time and budget. Call simon on 07 5538 77 22 for a quote today.                 ', 934, 'New', 0, 0),
(5, 'Manage Websites', 'Gold Caost', '', '', 'All areas', '', 'Queensland', 4217, 0, 'Manage-websites', '07 5538 7722', '0405451873', '0', 'sales@digitalblitz.com.au', 'managewebsites.com.au', 'simon', 'F6UNkC', '', 1, 0, '2', ' We have designed a simple to use website management system that allows you to manage multiple websites through one central solution.  The solution builds new websites and content dynamically. Aimed at the business professional looking to develop online content and search engine promotion.  A real-time, simple to use websites system design to promote your online content and improve your website rankings. We recommend and will install, google analytics, so that you can monitor and modify your own online marketing strategy. This is a customised service designed to appeal to a wide range of Australian and International business.\r\n\r\nWe will develop up to 10+ websites for you through a simple to use content management system (CMS). This system will incorporate existing static websites but any programming or database requirements can be integrated through additional specifications.\r\nPerfect solution for corporate individuals and business, promote your services and products through a very easy to use centralised website management system. Our CMS allows you to include add websites, pages, edit, Latest news area/Specials, create key word rich content and make your new website solution relevant .\r\n\r\nA real-time, simple to use websites system design to promote online content and website rankings. We recommend and will install, Google analytics, so that you can monitor and modify your own websites.\r\n\r\nmanage multiple websites from a single administration\r\n\r\n                ', 934, 'New', 0, 0),
