(11, 'Creative Web Logic', '15 parkview crs', '', '', 'yamba', '', 'New South Wales', 2464, 0, 'creative-web-logic', '0266469941', '0266469941', '0266469941', 'info@creativeweblogic.net', 'http://www.creativeweblogic.net', 'Daniel Ruul', 'info@creativeweblogic.net', '', 1, 0, '0266469941', 'We have been in business since 1999 and have delivered website design, software engineering and marketing solutions for clients throughout Australia. Specialising in graphical design for web, search engine optimisation and internet marketing, development of websites and web based application software and Microsoft Windows .NET Application software. We provide a complete solution to meet client needs.\r\n\r\nOur professionalism sets us apart from most web development, software engineering and internet marketing companies. Drawing on over ten years experience, and working with a diverse range of companies.          ', 3736, 'New', 0, 0),
(12, 'Yamba Web Design', '15 parkview crs', '', '', 'yamba', '', 'Queensland', 2464, 0, 'yamba-web-design', '0266469941', '0', '0', 'info@yambawebdesign.com', 'yambawebdesign.com', 'Daniel Ruul', 'info@yambawebdesign.com', '', 1, 0, 'xxx', 'Yamba Web Design Dot Com is dedicated to servicing the clarence valley region, including Yamba, Maclean, and grafton for all online services.          ', 934, 'New', 0, 0),
(13, 'Yamba Web Design', '15 parkview crs', '', '', 'yamba', '', 'New South Wales', 2464, 0, 'yamba-web-design', '0266469941', '0', '0', 'info@yambawebdesign.com', 'yambawebdesign.com', 'Daniel Ruul', 'info@yambawebdesign.com', '', 1, 0, 'xxx', 'Yamba web design is dedicated to service the development needs of the Clarence Valley especially yamba. We can use open source as well as proprietary computer languages such as PHP and ASP.Net', 3736, 'New', 0, 0),
(14, 'Ashby Cottage', '2 Tullymorgan Road', '', '', 'ashby', '', 'New South Wales', 2464, 0, 'ashby-cottage', '(02) 6645 4686', '0', '(02) 6645 5348', 'ashbycottage@bigpond.com ', 'www.ashbycottage.com', 'Jeoff & Julie Turner', 'ashbycottage@bigpond.com ', '', 1, 0, '0', 'Ashby Cottage is a perfect getaway for that romantic weekend away from prying eye\'s or will accommodate for a night away with friends,the choice is your\'s!\r\n\r\nSituated high on the hill at Ashby with beautiful views of the Clarence River,coastal plains extending  to the ocean. The cottage has it\'s own large private balcony with barbecue ,two bedrooms,two bathrooms,(one with spa),make your own cocktails in your self contained kitchen,while your guests wait in the dining room or lounge with a rustic wood fireplace,With all the mod cons such as  TV, DVD, VCR, CD and  for those hot day\'s the swimming pool will keep you cool as your car sits pretty in it\'s own carport.\r\nWake up to the serenity of silence as the surrounding nature starts the day with you. Enjoy cooking your own breakfast the way you like it provided by us. Be at peace as you gaze over the magnificent Clarence valley and beyond,feel the city stress slip away. So just give us a call we\'re already here.\r\n4 Star Rating ', 933, 'New', 0, 0),
(15, 'Aunty Marls Dog Friendly Holiday Cottage', 'x', '', '', 'yamba', '', 'New South Wales', 2464, 0, 'aunty-marls-dog-friendly-holiday-cottage', '(02) 6645 8721', '0', '0', 'info@creativeweblogic.net', '', 'aunty marl', 'Aunty Marls', '', 1, 0, 'x', 'Feel like getting away but don\'t want to leave your beloved pooch with friend\'s or family. Well don\'t,bring them along they\'ll love it. Yamba has it\'s own dog friendly beach where the tree\'s meet the sea, they can chase all the seagulls they want.\r\nThe cottage is well cleaned after every visitor. Your best mate can hang out with you inside as the cottage is fully tiled. If you feel like going out for lunch without your mate, they\'ll be alright hanging out in the fully fenced backyard. I thought I should mention that Yamba is human friendly also, so come check it out.', 933, 'New', 0, 0),
(16, 'Twin Pines Motel Yamba', '9 Wooli St', '', '', 'Yamba', '', 'New South Wales', 2464, 0, 'twin-pines-motel-yamba', '(02) 6645 8055', '0', '(02) 6645 8050', 'stay@yambatwinpines.com.au', 'www.yambatwinpines.com.au', 'x', 'stay@yambatwinpines.com.au', '', 1, 0, 'x', 'This Motel is situated within walking distance of Yamba\'s main street where you can find just about anything your after, including Yamba Bowling Club directly opposite. If you don\'t feel like going  out, just lay back in your Air-conditioned room or choose one our activities such as Wireless internet, Austar or have a barbeque overlooking our tropical pool. If you want to treat yourself ask about our Ocean view Apartment.      ', 933, 'New', 0, 0),
(17, 'Scorpio Holiday Units', '14 Ocean Street', '', '', 'Yamba', '', 'New South Wales', 2464, 0, 'scorpio-holiday-units', '(02) 6646 2321', '0', '0', 'bigray@tpg.com.au', '#', 'Big Ray', 'bigray@tpg.com.au', '', 1, 0, 'x', 'Scorpio Holiday Units are among Yamba\'s exclusive Ocean st. With spacious two bedroom units and Northeast facing balconies, kick back with all the creature comforts available such as-tv, vcr,microwave and barbeque.Don\'t feel like staying it\'s only a short walk to Restaurant\'s,Cafe\'s and beaches.', 933, 'New', 0, 0),
(18, 'Yamba Waters Holiday Park', 'Golding Street', '', '', 'Yamba', '', 'New South Wales', 2464, 0, 'yamba-waters-holiday-park', '(02) 6646 2930', '0', '(02) 6646 2905', 'yambawaters@freespiritresorts.com.au', 'www.yambawaters.com.au', 'xx', 'yambawaters@freespiritresorts.com.au', '', 1, 0, 'x', 'Situated 30 seconds off yamba\'s main road and two minute drive from beaches is heaven for any family or group check it out we\'ve got. \r\n• Accommodation • Caravan & Camping sites - Ensuite & powered sites• 2 swimming pools (1 with spa) • Tidal salt water lagoon • Camp Kitchen• BBQ Areas • Children’s playgrounds • TV Room • Games Room • Internet Cafe\r\nFeel like getting out  Yamba\'s at your doorstep,Win win situation.', 933, 'New', 0, 0),
(19, 'Suncrest Unit 2', '2/2 Ocean Street', '', '', 'Yamba', '', 'New South Wales', 2464, 0, 'suncrest-unit-2', '(02) 6646 2400', '0', '(02) 6646 1599', 'holiday@nationwide-yamba.com.au', 'www.visityamba.com.au/ybi?agent=YAMPRD&mod=site-ipage1&Code=62', 'me', 'holiday@nationwide-yamba.com.au', '', 1, 0, 'x', 'UNIT 2\r\nCheck out this glorious view,doesn\'t get any better than this. Immaculate luxury unit that sleeps six people has two bathrooms and parking for two cars and a boat. \r\nPerfect for a few friends to getaway or spend it with loved one\'s the choice is yours.', 933, 'New', 0, 0),
(20, 'Sandilands', '55 Clarence Street', '', '', 'Yamba', '', 'Queensland', 2464, 0, 'sandilands', '(02) 6646 2321', '(02) 6646 2321', '(02) 6646 1583', 'iat@austarnet.com.au', 'www.yambansw.net', 'unknown', 'iat@austarnet.com.au', '', 1, 0, 'x', 'Sandilands situated Yamba Hill has outstanding view overlooking one of Yamba\'s favorite surf beaches,Pippi Beach.\r\n\r\nWith two bedroom units bring the family or get your mates together for a surfing holiday.', 933, 'New', 0, 0),
(21, 'Surf Motel', '2 Queen Street', '', '', 'Yamba', '', 'New South Wales', 2464, 0, 'surf-motel', '(02) 6646 2200', '(02) 6646 2200', '(02) 6646 1955', 'surf.motel@yambansw.net', 'surf-motel@yambansw.net', 'unknown', 'surf.motel@yambansw.net', '', 1, 0, 'x', 'Surf Motel is placed in a beautiful position overlooking Main beach, Lighthouse and Iluka.\r\nShort walk to Pippi\'s Cafe or the Pacific hotel with the Restaurants and Cafe\'s  just down the hill.', 933, 'New', 0, 0),
(22, 'Yamba YHA Backpacker Beach Resort', '26 Coldstream St', '', '', 'Yamba', '', 'New South Wales', 2464, 0, 'yamba-yha-backpacker-beach-resort', '(02) 6646 3997', '(02) 6646 3997', 'Fax (02) 6645 2284', 'yambabackpackers@bigpond.com', 'www.yambabackpackers.com.au', 'unknown', 'yambabackpackers@bigpond.com', '', 1, 0, 'x', 'The newest edition to Yamba is set up to cater for just about anything. It\'s smack bam in the middle of Yamba with it\'s multi share to family ensuites, It\' own licenced bar and  cafe open for breakfast through to dinner. On the next floor you can enjoy our entertainment deck, float around our exclusive swimming pool perched above Yamba\'s main street. Step up on our roof deck if  feel like getting a tan with panoramic views of Yamba. We\'ve got it all including – Undercover parking with lift, disabled rooms and bathroom facilities, bbq, laundry, communal kitchen, tv and reading, on site 24 hour managers, 24 internet cafe, free tea and coffee.\r\nYou can also step outside and explore Yamba\'s many beaches or cafe\'s, there\'s also fishing and for the surfers Angourie\'s only a 5 minute drive away.\r\nHours of operation:-\r\nReception: 8am to 9pm\r\nInternet Café: 24 hours\r\nLicensed Bar: 10am to 10pm\r\nCafé: 7am to 10pm', 933, 'New', 0, 0),
(23, 'Moby Dick Motel', '27-28 Yamba Road', '', '', 'Yamba', '', 'New South Wales', 2464, 0, 'moby-dick-motel', '(02) 6646 2196', '(02) 6646 2196', '(02) 6646 1383', 'reception@mobydick.com.au', 'www.mobydick.com.au', 'Moby', 'reception@mobydick.com.au', '', 1, 0, 'x', 'Moby Dick, by far one of the best waterfront Motel Resorts the Clarence River has to offer, with first class views to rival anywhere in Australia. Units feature a  private balcony , with self contained kitchens in every room and some having spa\'s. This is the perfect holiday for families or couples with all Yamba\'s beauty at your doorstep. We also do Wedding Ceremony packages for that special day. ', 933, 'New', 0, 0),
